(4, 'items', 'Sculpteur CPA Cotonou', 'Sculpteur CPA Cotonou\nKatia Guibert\nm4a', 2, 1),
(6, 'items', 'Visite guid√©e mus√©e d\'Abomey', 'Visite guid√©e mus√©e d\'Abomey\nKatia Guibert\nm4a', 2, 1),
(7, 'items', 'Gestionnaire mus√©e d\'Abomey', 'Gestionnaire mus√©e d\'Abomey\nKatia Guibert\nm4a', 2, 1),
(8, 'items', '¬´ Lire ensemble ¬ª √† l\'√©preuve du terrain : premi√®res conclusions', '¬´ Lire ensemble ¬ª √† l\'√©preuve du terrain : premi√®res conclusions\nL‚Äôenqu√™te de terrain men√©e au B√©nin entre le 25 avril et le 1 er mai permet de confronter √† l‚Äô√©preuve du terrain notre probl√©matique, peut-on lire ensemble dans un monde num√©rique ?\nLa BNF a mis √† notre disposition un riche catalogue de textes d‚Äôexplorateurs, datant du XV√®me au XX√®me si√®cle. De ce corpus a √©t√© cr√©√© un catalogue d‚Äôextraits centr√© sur la d√©couverte de l‚ÄôAfrique, du Dahomey et plus particuli√®rement ax√© sur le th√®me des dispositifs d‚Äôaccueil mis en place. Comment accueille-t-on l‚ÄôAutre ?\nCette s√©lection a permis de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚ÄôAutre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque : un point de vue qui sera dit ‚Äúdescriptif‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique, un point de vue dit ‚Äúcivilisateur‚Äù servant la justification de l‚Äôesclavage et un point de vue dit ‚Äúabolitionniste‚Äù. Cette √©volution suit une chronologie claire applicable au B√©nin, anciennement Dahomey.\nLors de notre enqu√™te de terrain, nous proposons √† nos enqu√™t√©s de lire, sur support √©lectronique, une s√©quence de trois extraits, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun d‚Äôentre eux et recueillons leurs r√©actions spontan√©es. Une fois cette premi√®re r√©action recueillie, nous leur pr√©sentons les interfaces par l‚Äôinterm√©diaire de vid√©os sur tablettes ou t√©l√©phones, en expliquant leur utilit√© et le concept d‚Äôinterface qui peut √™tre tr√®s abstrait pour qui n‚Äôest pas initi√©. Comment y r√©agissent-ils ?\nLe troisi√®me temps de cette enqu√™te est celui des r√©cits de vie. Il s‚Äôagit d‚Äôun temps du discours long pendant lequel l‚Äôenqu√™teur s‚Äôefface pour laisser la place au r√©cit de l‚ÄôAutre et le recueillir. Nous demandons aux personnes interrog√©es de nous raconter ce √† quoi elles pensent lorsque nous pr√©sentons notre sujet, mais √©galement de nous pr√©senter un objet qui leur semble important et d‚Äôen parler.\nA la fin de ces six jours d‚Äôenqu√™tes, quels √©l√©ments de r√©ponses pouvons-nous apporter ?\nKatia Guibert\nde 2019-04-25 √† 2019-05-01\nR√©sum√© de l\'enqu√™te de terrain\nProjet ¬´ Voyages en Afrique : lire ensemble dans un monde num√©rique ¬ª\npdf', 2, 1),
(9, 'items', 'Extrait 1 Ouidah Bertin Calixte Biah', 'Extrait 1 Ouidah Bertin Calixte Biah\nKatia Guibert\n2019-07-09\nmov', 2, 1),
(10, 'items', 'Diaporamas pr√©sentation colloque 2 mai 2019', 'Diaporamas pr√©sentation colloque 2 mai 2019\nAna√Øs Ramalho\n2 mai 2019\nSupport visuel de la pr√©sentation du projet ¬´ Lire ensemble ¬ª lors d\'un colloque.\npptx', 2, 1),
(11, 'items', 'Texte pr√©sentation colloque 2 mai 2019', 'Texte pr√©sentation colloque 2 mai 2019\nProbl√©matique de l‚Äôenqu√™te de terrain : \r\nL‚Äôenqu√™te de terrain men√©e au B√©nin entre le 25 avril et le 1er mai permet de confronter √† l‚Äô√©preuve du terrain notre probl√©matique, peut-on lire ensemble dans un monde num√©rique ?\r\nLa BNF a mis √† notre disposition un riche catalogue de textes d‚Äôexplorateurs, datant du XV√®me au XX√®me si√®cle. A la fin de ces six jours d‚Äôenqu√™tes, quels √©l√©ments de r√©ponses pouvons-nous apporter ?\r\nNous nous sommes pos√© la question de la mise en alt√©rit√©, fabrication d‚Äôune image de l‚ÄôAfrique par le regard occidental. Jusqu‚Äô√† quel point s‚Äôy fier ? Comment recueillir des contre-r√©cits qui nous permettrait de recentrer ? D√©placement de perspective qui ne met plus l‚Äôhomme europ√©en au centre mais plut√¥t l‚Äôhistoire locale.\n1) Pr√©sentation de la m√©thode de s√©lection des extraits de textes issus du corpus Afrique :\n-  Choix des axes :\nLe travail que j‚Äôai r√©alis√© a √©t√© celui de s√©lectionner dans un premier temps une cinquantaine d‚Äôextraits avec comme prismes de lecture 3 axes omnipr√©sents dans ces textes : les dispositifs d‚Äôaccueil d√©ploy√©s, les croyances et l‚Äôesclavage.\nApr√®s discussion et r√©flexion sur la suite du projet avec l‚Äô√©quipe et dans la perspective de l‚Äôenqu√™te de terrain nous avons orient√© la s√©lection pour le corpus propre au Dahomey sur les dispositifs d‚Äôaccueil. L‚Äôid√©e √©tant que les 2 autres axes pouvaient provoquer des r√©ticences de la part des enqu√™t√©s, car il s‚Äôagit de deux th√®mes faisant partie prenante de la cr√©ation d‚Äôun mythe autour de la religion de l‚ÄôAfricain et de l‚Äôesclavage.\nDe ce corpus a √©t√© cr√©√© un catalogue d‚Äôextraits centr√© sur la d√©couverte de l‚ÄôAfrique, du Dahomey et plus particuli√®rement ax√© sur le th√®me des dispositifs d‚Äôaccueil mis en place, spatialement et socialement. Comment accueille-t-on l‚ÄôAutre ? Contextualisation √† la fois de l‚Äôauteur-locuteur et de ses pr√©suppos√©s id√©ologiques, de la place de l‚Äôextrait dans l‚Äôouvrage et donc en g√©n√©ral de sa place dans le voyage, et une interpr√©tation.\nEn nous demandant quel √©tait le parti pris de l‚Äôauteur dans chacune de ces oeuvres, il a √©t√© possible de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚ÄôAutre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque :\nun point de vue qui sera dit ‚Äúdescriptif‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique -> √† ce moment le blanc n‚Äôest pas encore colon, il d√©couvre un nouveau territoire avec sa population et ses cultures donc l‚Äôasym√©trie des pouvoirs ne penche pas dans son sens, un point de vue dit ¬´ civilisateur ¬ª servant la justification de l‚Äôesclavage\r\n-> passage de la souverainet√© de l‚Äôafricain √† la non souverainet√©, et un point de vue dit ¬´ abolitionniste ¬ª\r\n-> dans certains propos tente de ramener aux premiers discours, mais la dimension de s√©paration raciale ne le permet pas. Perception de l‚Äôasym√©trie de pouvoir dont parlait Clemens Zobel.\nCette √©volution du regard de l‚Äôeurop√©en que les territoires et populations qu‚Äôil ‚Äúd√©couvre‚Äù (terme √† ne pas lire au sens propre pour tous les auteurs, ne sont pas tous des explorateurs) suit une chronologie claire applicable √† l‚Äôhistoire du Dahomey.\nL‚Äôaccueil est le premier point de contact, donc potentiellement de tension, or ce n‚Äôest pas ce qui ressort des r√©cits. La tension vient plus tard, dans l‚Äô√©change et dans le vivre ensemble.\n2) Pr√©paration de l‚Äôenqu√™te √† partir de la s√©lection : que veut on savoir ?\nComment lire les textes d‚Äôexplorateurs dans une approche interculturelle ?\nL‚Äôhistoire est commune mais nos r√©cits parlent-ils aux int√©ress√©s ? \nComment collecter des contre r√©cits (lien avec Arnaud) ?\nQuelle valeur leur accorder ?\nCes textes sont-ils de v√©ritables sources ou des repr√©sentations occidentales ?\nLe contre r√©cit permet de discuter la source et de la qualifier.\nVolont√© de multiplier les interlocuteurs aux profils diff√©rents pour balayer un large spectre de r√©ponses.\nChoix de la m√©thode :\n- triptyque de textes suivant une chronologie et qui v√©hicule une id√©ologie (projet√©s avant). Chercher √† faire r√©agir dessus. \n- R√©cit de vie et lien avec un objet : parler d‚Äôun objet et de sa symbolique. Id√©e de poser ces 3 questions, mais peur d‚Äô√™tre trop long.\nLors de notre enqu√™te de terrain, nous souhaitions proposer √† nos enqu√™t√©s de lire, sur support √©lectronique, une tablette, une s√©quence de trois extraits, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun d‚Äôentre eux et recueillons leurs r√©actions spontan√©es.\nDiapo : 3 extraits et auteurs.\nL‚Äôautre temps de cette enqu√™te est celui des r√©cits de vie. Il s‚Äôagit d‚Äôun temps du discours long pendant lequel l‚Äôenqu√™teur s‚Äôefface pour laisser la place au r√©cit de l‚ÄôAutre et le recueillir. Nous\r\ndemandons aux personnes interrog√©es de nous pr√©senter un objet dont la symbolique leur semble importante et de nous en parler.\nOrganisation des rendez-vous : en avance rep√©rage de personnes √† enqu√™ter.\n3) Temps de l‚Äôenqu√™te et premiers enseignements √† en tirer :\n√âquipe d‚Äôenqu√™te : Ana√Øs, Marwan et moi -> travail r√©alis√© en √©quipe sur le terrain, le recueil de mat√©riau et des r√©cits s‚Äôest fait en √©quipe. Une fois sur place temps courts avec d√©placements.\nExpliquer qui on a rencontr√© : √† chacun sa question et son illustration.\na) A ouidah, rencontre avec le conservateur du mus√©e (Bertin Calixte Biah ?). Pr√©sentation du 1er texte pour le faire r√©agir : il consid√®re que ce texte s‚Äôapplique √† l‚Äôensemble du peuple b√©ninois, on se doit d\'accueillir l‚Äôautre, et surtout dans de bonnes conditions. Le rapproche du fait de se rendre disponible pour nous. R√©ponse + portrait en diapo\nM√™me question pos√©e √† Camille Capo Chichi, dignitaire √† Ouidah, r√©agit √©galement un premier texte. \r\nR√©ponse + portrait en diapo\nSe pose alors le probl√®me de la longueur de notre √©change, il n‚Äôest pas possible de faire r√©agir sur 3 textes. Nous prenons alors la d√©cision de n‚Äôen pr√©senter qu‚Äôun. Des difficult√©s de lecture se pr√©sentent √©galement. Nous constations un d√©calage avec l‚Äô√©crit et pour ne pas perdre le contact avec les personnes qu‚Äôon rencontre, d√©cision de basculer sur la question de l‚Äôobjet.\n- Questionnement sur l‚Äôobjet tr√®s pertinent, donc adapt√© √† l‚Äôinterlocuteur. Recentrement sur l‚Äôobjet et sur la culture orale avec un r√©cit.\nRencontre au sein Maison de la famille Dossou Gbete, avec le Baba Lao, f√©ticheur pratiquant le f√¢, son titre signifie anc√™tre qui d√©tient le savoir. \nLe f√©ticheur parle en langue vernaculaire et est traduit par Gilbert Capo Chichi. A la question de l‚Äôobjet, il nous d√©signe un f√©tiche et nous en explique la signification. Diapo : portrait et f√©tiche + transcription de la symbolique\nQuestion sur l‚Äôobjet √©galement pos√©e au CPA, Bertrand, sculpteur, sculpte sur commande mais √† la question de la symbolique nous montre ce qu‚Äôil consid√®re √™tre son art : repr√©sentations des rois -> savoir-faire et savoirs historiques. (question de la commande qui perturbe la transmission des savoirs par son art)\r\nDiapo : portrait et sculpture + transcription de la symbolique\nYemandj√© : r√©cit de vie, transmission de son art par famille, lign√©e mais aujourd‚Äôhui volont√© de le transmettre aux autres afin que la tradition ne se perde pas, parle aussi du devoir de toujours accueillir l‚Äô√©tranger. \r\nDiapo : portrait avec tenture en arri√®re plan\nConclusion :\nLire ensemble oui, mais en fonction des interlocuteurs pas forc√©ment des textes. Mais tr√®s ouverts aux symboles. Difficult√©s terrain / point positifs non anticip√©s ( + : facilit√© devant la cam√©ra et photos, - : probl√®me de l‚Äô√©crit) .\nPeur de questionner sur les croyances infond√©e, parlent bcp de leurs croyances, nous les expliquent sans mal et volont√© de partager. Bcp d‚Äôexplications sur le F√¢, volont√© de partage de cette culture (consid√©r√© comme croyance par nous, mais est une science ici). Dimension interculturelle tr√®s pr√©sente pendant notre semaine de terrain. Pas v√©cu comme intrusif.\nPar contre esclavage, question peu abord√©e et difficile √† poser sans blocages.\nEnseignements de cette confrontation avec le terrain : m√®ne √† des par ex faire √©couter les textes, question des explorateurs un peu √©loign√©e d‚Äôune r√©alit√© sociale, peut √™tre √† contextualiser avec le voyage. Peur de parler des cultes alors que les b√©ninois en parlent avec bcp de facilit√©s et aiment partager leur culture.\nBcp de richesse dans les √©changes, de discours sur des th√®mes qui nous semblaient bloquant et de richesses dans les rencontres.\nCette semaine pass√©e ensemble √† recueillir les contre r√©cits ont permis √† Marwan et Ana√Øs de cr√©er -> dimension artistique de l‚Äôinterculturalit√©. \nKatia Guibert\n2019-05-02\nIntervention de Arnaud Laborderie lors de la pr√©sentation au colloque du 2 mai 2019.\nD√©tail du texte prononc√© lors de la pr√©sentation du projet ¬´ Lire ensemble ¬ª lors d\'un colloque.\nPr√©sentation du corpus Afrique de la BnF et annonce de la probl√©matique de l\'enqu√™te de terrain.\n1) Pr√©sentation de la m√©thode de s√©lection des extraits de textes issus du corpus Afrique de la BnF.\n2) Pr√©paration de l\'enqu√™te √† partir de la s√©lection des extraits de textes depuis le corpus Afrique de la BnF.\n3) Les temps de l\'enqu√™te et les premiers renseignements √† en tirer.\n4) Conclusion de l\'√©tude √† partir des extraits textuels provenant du corpus Afrique de la BnF.\ndocx', 2, 1),
(12, 'items', 'Protocole enqu√™te au B√©nin.', 'Protocole enqu√™te au B√©nin.\n1) M√©thode :\nUn travail de s√©lection d‚Äôextraits de textes a √©t√© r√©alis√© en amont de l‚Äôenqu√™te de terrain. Ceux-ci ont permis de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚Äôautre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque : un point de vue dit ‚Äúneutre‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique, un point de vue dit ‚Äúcivilisateur‚Äù servant la justification de l‚Äôesclavage et un point de vue dit ‚Äúabolitionniste‚Äù. Cette √©volution suit une chronologie claire applicable au B√©nin, anciennement Dahomey.\nApr√®s avoir cr√©√© cette s√©quence de points de vue, nous proposerons √† nos enqu√™t√©s de les lire, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun de ces extraits. Il faudrait id√©alement que l‚Äôenqu√™teur n‚Äôintervienne pas et afin de recueillir la r√©action spontan√©e de l‚Äôenqu√™t√©. Si toutefois l‚Äôenqu√™t√© ne r√©agissait pas, l‚Äôenqu√™teur devra poser des questions larges du type ‚Äúqu‚Äôen pensez-vous?‚Äù, ‚Äú√† quoi cela vous fait penser ?‚Äù. \nUne fois cette premi√®re r√©action recueillie, nous pr√©senterons les interfaces par l‚Äôinterm√©diaire de vid√©os sur tablettes ou t√©l√©phones, en expliquant leur utilit√©. Ne pouvant pas faire manipuler ces interfaces aux enqu√™t√©s, cette partie de l‚Äôenqu√™te peut demander plus de temps d‚Äôexplication sur la mani√®re dont elles pourraient √™tre utilis√©es. Il s‚Äôagit maintenant de r√©fl√©chir √† la mani√®re de pr√©senter sur place le concept d‚Äôinterface qui peut √™tre tr√®s abstrait pour qui n‚Äôest pas initi√©. Comment l‚Äôexpliquer de mani√®re simple et concise ?\nLe troisi√®me temps de cette enqu√™te est celui des r√©cits de vie. Nous demanderons aux personnes interrog√©es de nous raconter ce √† quoi elles pensent lorsque nous pr√©sentons notre sujet. L‚Äôenqu√™teur s‚Äôefface alors compl√®tement pour laisser la personne libre de son r√©cit.\n2) Moyens :\nLes textes et les interfaces seront pr√©sent√©s sur support √©lectronique (t√©l√©phone ou tablette). Il faudra donc veiller √† avoir du mat√©riel toujours charg√©, et des batteries externes. Les √©changes seront enregistr√©s (et/ou film√©s) pour ensuite pouvoir les transcrire.\nDeux √©tudiants b√©ninois de l‚Äôinstitut Cerco nous accompagneront en tant que facilitateurs; ils pourront aider √† nous introduire aupr√®s de certains publics et permettre le premier contact. \r\nD‚Äôautre part, afin de pallier notre manque de connaissances des langues vernaculaires, nous serons √©galement accompagn√©s d‚Äôun traducteur.\nKatia Guibert\nProtocole de l\'enqu√™t de terrain effectu√©e au B√©nin dans le cadre du projet ¬´ Lire ensemble ¬ª.\ndocx', 2, 1),
