(26, 'items', 'Historial description de l\'Afrique, tierce partie du monde. 1', 'Historial description de l\'Afrique, tierce partie du monde. 1\nDescription de l‚ÄôAfrique\n1556\n1956\nL√©on l\'Africain\nA. Epaulard\nhttps://gallica.bnf.fr/ark:/12148/bpt6k79222f?%20rk=64378;0 Gallica\nhttps://archive. org/details/descriptiondelaf03leoa Archive.org\nmonographie imprim√©e\nCroyances\nEsclavage\nL√©on l\'Africain, de son vrai nom Hassan Ibn Mohammed et-Ouazzan, n√© entre 1486 et 1488 √† Grenade. Sa famille s\'exile √† F√®s, au Maroc lors de la Reconquista, o√π il suit une formation de lettr√©. Il devient ensuite diplomate et parcourt l\'Afrique et le Moyen Orient. Lors de l\'un de ses voyages il est captur√© √† Djerba et offert au pape L√©on X. Il re√ßoit une instruction catholique et se fait baptiser en 1520. Le pape lui donne comme nom chr√©tien son propre nom, L√©on de M√©dicis. A la demande du pape il r√©dige sa description de l\'Afrique\nLes extraits choisis son tir√©s du livre septi√®me ¬´ O√π il est trait√© du pays des noirs ¬ª. L√©on l\'Africain y d√©crit un √† un les royaumes qu\'il a parcouru. Grande neutralit√© √©galement chez L√©on l\'Africain.\r\nMelli, royaume\r\nll s\'agit d\'une description du royaume du Mali (Melli dans le texte).\nGago et le royaume d\'icelle. Il s\'agit du royaume de Gaoga, une petite entit√© politique que l\'on situe difficilement.\nAgadez et son royaume. Ville du Niger.\nP.291 : ¬´ Ils ont des pr√™tres et lecteurs, qui lisent dans leurs temples, et pour ce qu\'il n\'y a point de col√®ges et sont ceux-cy les plus civils, de meilleur esprit et plus grande reputation de tous les Noirs, pour autant qu\'ils furent les premiers √† recevoir la loy de Mahommet et de ce temps l√†, furent subjugu√©s par un grand prince entre les peuples de Libye, qui √©toyt oncle de Joseph, roy de Maroc, duquel la seigneurie demeura √† ses successeurs jusques au temps d\'Izchia [...] ¬ª\nP.293 : ¬´ Les marchans de Barbarie transportent plusieurs draps d\'Europe en cette cit√©. Les femmes vont ordinairement le visage couvert, fors les esclaves qui vendent toutes les choses de bouche. ¬ª\nP.299 : ¬´ Il y a plusieurs pluy d\'eau douce, avec une grande place, en laquelle, au jour du march√©, se vendent les esclaves tant hommes que femmes ; et s\'ach√®te une fille de quinze ans au prix de six ducats, et autant un gar√ßon.\r\nLe toy tient en un palais √©cart√© une infinit√© de concubines, esclaves et eunuques. ¬ª\nPP.302-303 : ¬´ Les maisons sont fort bien b√¢ties et en la mani√®re de celles de Barbarie, pour ce qu\'il ne s\'y trouve gu√®re de marchans autres qu\'etrangers ; et ce peu qu\'on y void du pa√Øs sont tous artisans, ou √† la soulde du roy de cette cit√©, en laquelle n\'y a marchant, qui ne tienne un grand nombre d\'esclaves pour s\'en aider √† ses affaires [...]. ¬ª\nL\'auteur parle du royaume du Mali comme du premier royaume Noir √† √™tre devenu musulman, et consid√®re de ce fait ses habitants comme les plus √©duqu√©s.\nAu royaume du Mali l\'auteur mentionne l\'esclavage uniquement en d√©crivant l\'importance des marchands √† Tombut (Tombouctou). Ici, il s\'agit des esclaves de marchands venus de Barbarie (Maghreb actuel).\nL\'esclavage semble tenir une place plus importante au royaume Gago. On apprend que les esclaves y sont vendus, mais √©galement que le roi en d√©tient un grand nombre au sein de son palais.\nComme au royaume Melli, les esclaves mentionn√©s dans cet extrait sont les esclaves de marchands venant de Barbarie.', 2, 1),
