(37, 'item_sets', 'Sc√©narii d\'oralit√©s num√©riques', 'Sc√©narii d\'oralit√©s num√©riques\nL\'ex√©cution du scenario consiste √† passer d‚Äôune s√©quence √† une autre, soit, dans la lecture de la proposition d‚Äôun auteur d‚Äôune s√©quence √† la suivante, soit par un saut √† la s√©quence de m√™me rang dans la proposition d‚Äôun autre auteur. La navigation consiste alors √† descendre au n≈ìud suivant dans la branche par la touche ¬´ suivant ¬ª ou √† passer au n≈ìud de m√™me niveau dans une autre branche en cliquant sur la lettre (a, b, c , d...) attribu√©e √† cette branche. ', 1, 1),
(38, 'items', 'Jason & Eve', 'Jason & Eve\nOralit√© num√©rique pr√©sent√©e √† la conf√©rence Lire Ensemble\nNina Erryck a propos√© une trame reposant sur une th√©matique couramment repr√©sent√©e dans la litt√©rature orale ghan√©enne : l‚Äôhistoire d‚ÄôAdam et Eve. Nina propose la transcription dans le dispositif d‚Äôune variante d√©jant√©e de ce mythe qu‚Äôelle a √©crite sous le titre Jason and Eve. Le sc√©nario est d√©coup√© en 10 s√©quences.\n../../oralites-numeriques?scenario=svg38 Ex√©cuter le sc√©nario\nNina Erryck\nPhilippe Bootz\nSamuel Szoniecky\nEverardo Reyes\n1 : titre et auteurs\n2 : Jason vit den 2019 dans monde domin√© par le diable\n3 : Jason est d√©prim√©. Il tente de comprendre l‚Äôorigine de la pr√©sence du mal dans le monde et en arrive √† la conclusion qu‚Äôil doit remonter le temps jusqu‚Äôau paradis terrestre pour dissuader Adam et Eve de croquer le fruit d√©fendu\n4 : Durant ce temps, dans le jardin d‚ÄôEden, le diable, au courant de l‚Äôintention de Jason, demande au d√©mon Lilith de l‚Äôaider √† d√©jouer le plan de Jason\n5 : Jason arrive au jardin d‚ÄôEden\n6 : Jason arrive au jardin d‚ÄôEden. Lilith kidnappe Adam, procr√©e avec lui et met au monde une multitude de d√©mons\n7 : Le diable persuade Eve de manger le fruit d√©fendu en lui disant que cela lui rendra Adam. Eve mange le fruit et s‚Äôeffondre\n8 : Le diable incite Jason √† manger √† son tour le fruit d√©fendu, lui disant que cela ram√®nerait Adam et Eve\n9 : Jason mange le fruit et le diable dispara√Æt avec Eve\n10 : Jason revient en 2019 et constate que le monde n‚Äôa pas chang√© mais que le mal est encore plus pr√©sent.', 1, 1),
