(40, 'items', 'Description de l‚ÄôAfrique, tierce partie du monde.', 'Description de l‚ÄôAfrique, tierce partie du monde.\nRecueil de voyages et de documents pour servir √† l\'histoire de la g√©ographie. Depuis le XIIIe jusqu\'√† la fin du XVIe si√®cle.\nJean-L√©on African\n1956\nhttps://archive.org/details/descriptiondelaf03leoa/page/n7 Archive.org\nERNEST LEROUX\nVolume 3', 2, 1),
(41, 'items', 'Relation des voyages √† la c√¥te occidentale d\'Afrique', 'Relation des voyages √† la c√¥te occidentale d\'Afrique\nP.79 De la foy de ces premiers noirs.\nP.82: De la mani√®re des habits et coutumes des noirs\r\nextrait: \" Ce sont des gens de grandes paroles, et n\'ont jamais fait qu\'ils n\'ayent toujours quelque chose √† r√©pliquer; au reste, menteurs au possible et grans trompeurs, autrement fort charitables, pour ce qu\'ils ne lairront passer aucun √©tranger sans luy donner √† boire et manger pour un repas en leur maison, ou bien le logent pour une nuict, sans en demander aucune r√©compense.\nPP. 86-88 : Du pa√Øs de Budomel, et du seigneur d\'iceluy.\nPP 96-100: Cerimonies desquelles Budomel veult qu\'on use lors qu\'il donne audience et de la mani√®re qu\'il observe faisant ses pri√®res\nAlvise de CA DA MOSTO \n1895\nCroyances\nDispositif d\'accueil\nAlvise de CA DA MOSTO (1432-1488). Commer√ßant et navigateur v√©nitien. Il part en 1455 pour le compte d\'Henri le Navigateur (fr√®re du roi du Portugal, m√©c√©ne d\'exp√©ditions) pour deux √©xp√©ditions maritimes sur les c√¥tes africaines encore m√©connues. Ses deux √©xp√©ditions le m√®nent sur les c√¥tes du S√©n√©gal et de la Gambie, d√©couvrant au passage certaines iles du Cap Vert.\nTexte le plus ancien de notre corpus qui apporte donc le point de vue le plus neutre. L\'auteur d√©couvre l\'Afrique sans pr√©jug√©s aucuns. D√©couvre l\'alt√©rit√© africaine. Dans cet extrait il compare leur foi √† celle des berb√®res. Il parle donc de leur foi \"Mahom√©tane\" commune, mais pratiqu√©e \"plus froidement\" par les \"noirs\" √† cause de l\'influence chr√©tienne.\nCa da Mosto d√©crit l\'accueil r√©serv√© par les populations locales aux explorateurs europ√©ens.\nOn observe dans cet extrait les rituels d\'accueil des marchands √©trangers par ce souverain africain : √©change et achat de marchandises, cadeau (une esclave). L\'auteur se montre curieux de \"voir et entendre quelques nouveaut√©s\". Il y demeure 28 jours.\nL\'auteur observe les coutumes et croyances avec une grande neutralit√©, et pr√©cise m√™me √† \"selon mon jugement\" lorsqu\'il √©met un avis.\r\npp98-100: l\'auteur d√©crit le culte musulman et la mani√®res dont les azen√®gues pr√©sents instruisent le roi sur celui-ci. C\'est √† la demande du roi que Ca Da Mosto √©nonce des pri√®res chr√©tiennes et d√©crit sa foi. La discussion entre l\'auteur et le roi Budomel sur la foi montre l\'ouverture de chacun et la curiosit√© de d√©couvrir l\'autre.\nhttps://gallica.bnf.fr/ark:/12148/bpt6k1048998/f97.image.r=voyages%20en%20afrique%20noire%20alvise Gallica\nImage\nApr√®s avoir cotoy√© les berb√®res azen√®gues, l\'auteur emprunte le fleuve S√©n√©gal pour se retrouver en Guin√©e. Il y observe le mode de vie des autochtones.\nL\'auteur en remontant le fleuve S√©n√©gal arrive au royaume de Cayor ou Kadior, dont le souverain porte le titre de Budomel (en wolof). Il s\'agit l√† de sa premi√®re rencontre avec le roi Budomel.\nCa da Mosto est toujours avec le roi Budomel et observe les coutumes selon lesquelles les sujets se pr√©sentent au roi. Il est √©galement invit√© √† entrer dans la mosqu√©e pour la pri√®re. S\'en suit alors un d√©bat sur la foi de chacun.', 2, 1),
