(109, 'items', 'Description de l\'Afrique : contenant les noms, la situation & les confins de toutes ses parties, leurs rivi√®res...', 'Description de l\'Afrique : contenant les noms, la situation & les confins de toutes ses parties, leurs rivi√®res...\n1686\nOlfert Drapper (1635-1689), humaniste n√©erlandais. Il entreprend des recherches g√©ographiques et publie en 1668 sa description de l\'Afrique. N\'ayant jamais quitter les Pays-Bas, il s\'agit d\'un ouvrage de synth√®se d\'ouvrages d\'histoire, de g√©ographie et de r√©cits de voyages consult√©s.\nmonographie imprim√©e \nhttps://gallica.bnf.fr/ark:/12148/bpt6k104385v?rk=128756;0 Gallica', 2, 1),
(110, 'items', 'Relation d‚Äôun voyage, fait en 1695, 1696 et 1697, aux c√¥tes d‚ÄôAfrique, d√©troit de Magellan, Br√©sil, Cayenne et isles Antilles, par une escadre des vaisseaux du Roy', 'Relation d‚Äôun voyage, fait en 1695, 1696 et 1697, aux c√¥tes d‚ÄôAfrique, d√©troit de Magellan, Br√©sil, Cayenne et isles Antilles, par une escadre des vaisseaux du Roy\n1972\n1686\nFran√ßois Froger\nhttps://gallica.bnf.fr/ark:/12148/bpt6k86195v.image Gallica\nMonographie imprim√©e\nDispositifs d\'accueil\nCroyances\nEsclavage\nFran√ßois FROGER, n√© en 1676, explorateur fran√ßais. Il part en exp√©dition en 1695 sur le navire de Jean-Baptiste de Gennes et relate son voyage dans son ouvrage. Il y relate ce qui lui semble int√©ressant pour le lecteur et enrichit son ouvrage de cartes.\nL\'auteur relate l\'arriv√©e de son bateau sur l\'√Æle de Gor√©e (au large de Dakar) et d√©crit ce qu\'il y observe comme mode de vie.\nL\'√©quipage quitte Gor√©e et remonte le fleuve Gambie. De Gennes prend aux anglais le fort Saint-James, renomm√© par les fran√ßais fort Saint-Jacques et n√©gocie cette prise avec le roi Bar.\r\nIls quittent l\'Afrique apr√®s la prise ce fort pour se rendre au Br√©sil et tenter de passer le d√©troit de Magellan.\nPP.5-7 ¬´ Le gouverneur de cette ille envoya aussit√¥t complimenter monsieur de Gennes [...] que nous avions d\'aller √† Gambie ¬ª\nPP.17-18 : ¬´ Les Marabous sont en grand nombre ; ils ont chacun plusieurs femmes ; ils prient Dieu cinqfois le jour : mais seulement √† minuit, au lever et au coucher du Soleil, et avant les pri√®res ils se lavent plusieurs fois tout le coprs ; ils √©crivent et parlent l\'Arabe, comme nous faisons le Latin ¬ª\nPP.18-20 : ¬´ La plupart des N√®gres sont sans Religion et vivent dans les bois du butin qu\'ils font sur les passants. Ceux qui ont quelque croyance suivent une secte de Mahomet fort corrompue ; ils portent au col, aux bras, aux jambes et m√™me lient √† leurs cheveux des petits sachets de cuirs qu\'ils appellent Grisgris, o√π ils enferment des passages d\'Alcoran, que les Marabous leur donnent pour les garentir des b√™tes venimeuses et de toute sorte de blessure (superstition abominable qu\'ils observent √©galement sur les chevaux qu\'ils mennent √† la guerre). Ils circoncisent leurs enfants : mais ce n\'est qu\'√† l\'√¢ge de 12 ou 13 ans. Le jour de Sabbath est le lundi ; ils ne travaillent point et ne font aucun repas ce jour-l√†. Ils n\'ont aucune f√™te consid√©rable que le Tabask√© qui arrive au mois de juin [...]Voil√† tout ce que j\'ai v√ª et pu apprendre de cette C√¥te qui l\'ait paru vraisemblable. ¬ª\nPP 16-17 : ¬´ En descendant cette riviere nous mimes √† terre au bourg de Barifet, o√π il y a un petit roy, tributaire de celui de Block. Ce roy nous envoya dire que c\'√©tait la coutume des Etranger de lui faire quelque pr√©sent et qu\'il nous priair de lui envoyer un manteau d\'√©carlate ; nous le contentames avec quelques bouteilles d\'Eau de vie, qu\'il re√ßut plus agr√©ablement qu\'il n\'aurait fait le plus beau manteau du monde. ¬ª\nPP 34-36 : ¬´ Le lendemain monsieur de Gennes fut rendre visite au roi, les principaux officiers vinrent au devant de lui jusqu\'√† son canot et le men√®rent au lieu ou se devoit faire l\'entrevue.\r\nLe roi parut aussit√¥t sans ordre au milieu d\'un grand nombre de N√®gre et de quelques Tambours ; il √©tait d\'une taille assez avantageuse et v√©tu d\'un petit poupoint rouge, couvert de queues de B√™tes sauvages et de Grelots, il avait sur la t√™te un bonnet d\'Ozier orn√© de plusieurs rangs de corail et de deux cornes de b≈ìuf [...]. Le roi en ce pompeux √©quipage et la pipe √† la bouche s\'avan√ßa sous un gros arbre, o√π il donna audience aux ambassadeurs des rois ses voisins. Monsieur de Genne l\'y alla saluer et lui fit pr√©sent de vingt barre de Fer, d\'un baril d\'eau de vie, d\'une paire de pistolets et d\'un mliroir ardent dont l\'√©preuve le surpris beaucoup. Comme l\'interpr√®te qui √©tait un fran√ßois √©tablit sur la rivi√®re depuis plus de dix ans avait beaucoup de facilit√© √† parler la langue du pays, ils eurent une longue conversation et entr\'autres choses, ce pauvre roi demanda plusieurs fois si on parlait beaucoup de lui en France. Apr√®s plusieurs discours semblables il se quitt√®rent, le roi fit reconduire Monsieur de Gennes par quarante de ses gardes et quelques tambours et lui fit pr√©sent des plus beaux b≈ìufs qui se purent trouver dans le bourg ¬ª\nPP46-47 : ¬´ Les portugais nous ont dit que les N√®gres qui sont avanc√©s dans les terres et avec qui ils ont peu de commerce sont tout √† fait sauvages, se vantent d\'√™tres de grands sorcier, ont peu de religion ; que lorsqu\'il meurt un roi, ou quelqu\'un des principaux, ils le mettent dans une caze neuve, tuent sa femme favorite, et un certain nombre d\'esclaves pour le servir dans l\'autre monde et qu\'enfin apr√®s avoir fait quelques pri√®res et avoir mis dans cette caze des vivres et du tabac pour un temps assez confortable, ils la couvrent de terre. ¬ª\nFroger d√©crit les √©changes entre son √©quipage et la population de Gor√©e. Il s\'agit de troc ¬´ Les n√®gres venaient continuellement √† bord avec leurs pirogues charg√©es de poissons qu\'ils nous donnaient pour des couteaux, quelques feuilles de papier [...] ¬ª\nFroger fait √©galement r√©f√©rence √† l\'Islam et √† la mani√®re dont cette religion est pratiqu√©e. Il d√©crit ici le rituel de pri√®re.\nL\'auteur parle de ¬´ secte de Mahomet fort corrompue ¬ª car les rites diff√®rent de ceux de l\'Islam, notamment par l\'usage de grisgris, o√π dans le d√©roulement du sacrifice de Tabask√©.\nFroger d√©crit l\'accueil de son √©quipage par le roi de Block qui r√©clame des pr√©sents. Il est int√©ressant de noter que le pr√©sent offert ici est de l\'eau de vie.\nFroger d√©crit la n√©gociation entre le roi et de Gennes pour la possession du fort Saint-Jacques : √©change de pr√©sents et discussion. Cet extrait nous apprend la pr√©sence d\'un interpr√®te qui vivrait dans la r√©gion depuis plus de dix ans.\nL\'auteur relate ici des propos rapport√©s par des portugais rencontr√©s sur place. Il ne s\'agit donc pas de sa propre observation. Il parle de rites mortuaires avec sacrifices humains, √† la fois d\'esclaves et de l\'√©pouse du roi d√©funt.\nHachette\nM. Brunet', 2, 1),
(111, 'items', 'Voyage de Guin√©e : contenant une description nouvelle et tr√®s-exacte de cette c√¥te o√π l\'on trouve et o√π l\'on trafique l\'or, les dents d\'elephant et les esclaves...', 'Voyage de Guin√©e : contenant une description nouvelle et tr√®s-exacte de cette c√¥te o√π l\'on trouve et o√π l\'on trafique l\'or, les dents d\'elephant et les esclaves...\n1705\n1974\nhttps://gallica.bnf.fr/ark:/12148/bpt6k861877?rk=42918;4 Gallica\nDispositifs d\'accueil\nCroyances\nEsclavage\nL\'ouvrage est divis√© en plusieurs lettres, traitant chacune de sujets diff√©rents. La neuvi√®me lettre traite entre autres de ¬´ la civilit√© qu\'ils font √† ceux qui viennent les voir ¬ª.\nDixi√®me lettre\nDix-huiti√®me lettre\nDix-neuvi√®me lettre\nWillem Bosman, (1672-?). Marchand au service de la compagnie des indes n√©erlandaise. Il passe la majorit√© de sa vie en Gold Coast n√©erlandaise, et rentrer aux Pays-Bas en 1702. La description qu\'il fait de la Guin√©e est une r√©f√©rence car il y d√©crit avec pr√©cision le commerce d\'esclaves.\nPP. 132-133\nPP. 148-165\nP.344 : ¬´ Outre cela, ces peulples trafiquent en esclaves, que ces Negres ach√®tent aussi d\'eux ; mais la plupart des esclaves sont transportez par les vaisseaux Anglois, Francois, & Portugais. Le trafic des esclaves est quelquesfois fort avantageux ici & surtout aux environs du village de Lay.\r\nIl arrive bien aussi, que lorsque les guerres cessent plus avant dans le paus, on ne trouve plus ici d\'esclaves : de sorte que le negoce y est fort incertain, & ce n\'est qu\'en passant qu\'on s\'y arr√™te ; mais il n\'y faut pas faire beaucoup de fonds ¬ª\nP.351 : ¬´ Ceux de Popo vivent de la m√™me mani√®re que ceux de Coto, c\'est √† dire, du butin qu\'ils font des esclaves qu\'ils vendent. Mais ils surpassent pourtant beaucoup les premiers, car √©tans plus hardis, ils font aussi plus de butin, & par consequent leur negoce est plus considerable, cependant il faudroit quelques mois pour charger ici un vaisseau d\'esclaves.\r\nL\'an 1697, je ne pus acheter que trois esclaves en trois jours que j\'y demeurai ; mais ils m\'assurerent que si je voulois attendre encore trois jours, ils m\'en pourroient fournir pr√®s de deux cens : j\'√©coutai leur proposition, mais √©tant all√© √† bord sous pretexte de chercher des marchandises qu\'ils demandoient, je fis lever l\'ancre et mettre les voiles pour aller √† Fida, & quand je fus arriv√©, j\'appris que leur course avoit si bien reussi qu\'ils avoient prus plus de deux cens esclaves, & que faute d\'autres marchands, ils furent obligez de les vendre aux portugais. ¬ª\nP.358 : ¬´ Je ne saurois m\'empecher de rendre t√©moignage √† leur civilit√©. Ils nous traitent tous, depuis le plus grand jusqu\'au moindre, de la mani√®re du monde la plus honn√™te & la plus respectueuse. Les autres N√®gres nous importunent sans cesse pour avoir des pr√©sens, mais ceux-ci ne nous demandent jamais rien qu\'un peu de brandevin, & ils aimeroient mieux nous faire des pr√©sens, que d\'en recevoir de nous, si ce n\'est quand quand nous avons trafiqu√© avec eux, ils aiment bien que nous reconnoissions les services qu\'ils nous ont rendus ; mais outre cela, ils sont inviolablement attach√©s √† leurs anciennes coutumes, √† quoi personne ne peut raisonnablement rien trouver √† redire. ¬ª\nP.362 : ¬´ Les maris sont si jaloux de leurs femmes, que sur le moindre soup√ßon ils les vendent aux Europ√©ens pour les transporter ailleurs, & ils ne font pas comme les N√®gre de la C√¥te de Guin√©e qui n√©gocient avec leurs femmes ; mais il n\'en va pas de m√™me ici. Si quelqu\'un couche avec la femme d\'un autre, il se doit presque assurer de mourir, en cas que la partie offens√©e ait du bien, & il arrive m√™me souvent, que pour son crime toute la famille est r√©duite √† l\'esclavage. ¬ª\nP.381 : ¬´ Il a trois receveurs pour le negoce des esclaves ; car chaque esclave qu\'on √©change ou qu\'on vend doit un √©cu au Roi ; mais ceux-ci font comme les autres, & s\'accordent avec ceux qui nous vendent les esclaves de sous main ; et de sorte que le Roi n\'en a rien. Il est vrai qu\'il a plus de pr√©caution √† l\'√©gard des esclaves qu\'on paye en bousies, (c\'est l\'argent de ce pays ci) retirant de chaque esclave trois √©cus ; car les payemens se font en sa pr√©sence & c\'est en quoi on lui fait le moins de tort ¬ª\nA. Schouten (Utrecht)\nInstitut National des Langues Orientales (Paris)', 2, 1);
