(112, 'items', '\r\n    M√©moires du r√®gne de Bossa-Ahad√©e, roi de Dahom√©, √©tat situ√© dans l\'int√©rieur de la Guin√©e, et voyage de l\'auteur √† Abom√©, qui en est la capitale. On y a ajout√© des Observations sur la traite des n√®gres...', '\r\n    M√©moires du r√®gne de Bossa-Ahad√©e, roi de Dahom√©, √©tat situ√© dans l\'int√©rieur de la Guin√©e, et voyage de l\'auteur √† Abom√©, qui en est la capitale. On y a ajout√© des Observations sur la traite des n√®gres...\n1790\nNorris, Robert\nWadstr√∂m, Carl Bernhard\nhttps://gallica.bnf.fr/ark:/12148/bpt6k862071/f2.image Gallica\nmonographie imprim√©e\nDispositifs d\'accueil\nNorris, Robert (1724?-1791). Historien, voyageur, auteur d\'√©tudes sur l\'esclavage. L\'auteur est pr√©sent√© d√®s l\'avant propos comme contre l\'abolition. Le traducteur nous met en garde : \"L\'auteur de ces m√©moires est contre l\'abolition, par cons√©quent il n\'a pas flatt√© le tableau de l\'Afrique et de ses habitants.\"\nL\'auteur arrive au Dahomey dans le but d\'acheter des esclaves. Il cherche √† rencontrer le roi.\nL\'auteur est en route pour Abomey et en chemin s\'arr√™te √† Calmina.\nArriv√©e √† Abomey.\nL\'auteur est introduit au roi d\'Abomey au sein de son palais.\nP. 74: \"Mes affaires exigeant que j\'eusse une entrevue avec le roi, je m\'adressai au vice-roi pour avoir le nombre d\'hommes n√©cessairesw pour m\'accompagner. Il me donna en effet un interpr√®te, dix hommes pour les hamacs, dix porteurs et un chef pour commander cette troupe : ce chef √©tait responsable de la conduite des autres: mes propres domestiques, et quelques autres qui accompagnaient le capitaine et qui √©taient arm√©s, formaient une caravane de trente personnes.\"\np.95: \"Je fus introduit √† Calmina dans les appartements de la maison du Maybou et j\'y re√ßus un messager de sa part, avec des compliments de felicitation sur mon heureuse arriv√©e; il d√©sira savoir dans quel temps je me proposais de faire mon entr√©e √† Abom√© et si je voudrais consentir √† √™tre re√ßu en c√©r√©monie par les grands officiers de la cour. L\'√©tiquette, en ces cas-l√† consiste en ce que le premier ministes et autres personnes de haute distiction vont avec un cort√®ge nombreux et sous les armes, au devant de la personne qu\'on re√ßoit. Cette troupe √©x√©cute diff√©rents exercices militaires, et fait quelques d√©charges de mousqueterie, apr√®s quoi les chefs descendent et re√ßoivent l\'√©tranger sous l\'ombrage de grands parasols; il lui p√©sentent d\'abord un gobelet d\'eau fra√Æche, et ensuite un petit verre d\'eau de vie qui est bu √† la sant√© du roi: alors ils marchent √† pied et accompagnent jusqu\'√† la ville celui auquel ils rendent ces honneurs.\"\nP.97: \" A mon arriv√©e √† la porte d\'Abom√©, je fus salu√© de quinze coups de canon, et conduit dans les appartements des blancs, dans la maison du Maybou: son intendant m\'attendait avec un pr√©sent de la part de son ma√Ætre et qui consistait en un peu d\'eau fra√Æche, un pot de pitto et quelques volailles. Le Maybou parut bientot accompagn√© par Eubiga, le vice-roi de Juda, et vint me f√©liciter, de la part de son maitre, de mon heureuse arriv√©e, et de ce que j\'avais fait ma route sans accident, ou sans en avoir √©t√© incommod√©. Ce compliment fut suivi d\'un pr√©sent de la part du roi, √† savoir d\'un mouton, de quelques volailles, de deux jarres de pitto, de deux corbeilles cde farine de froment, d\'une callebasse d\'huile de palme, d\'une de sel et d\'une bouteille d\'eau de vie.\"\np.107: \"Le 5 f√©vrier √† dix heures, accompagn√© de mon interpr√®te je fus re√ßu √† la porte par le Maybou, il y avait de chaque c√¥t√© du seuil une t√™te d\'homme r√©cemment coup√©e, [...], il y avait dans le corp de garde environ 40 femmes, arm√©es chacune d\'un mousquet et d\'un sabre, et 20 eunnuques. L\'un d\'eux se d√©tacha pour aller annoncer mon arriv√©e. [...] Apr√®s avoir salu√© le roi, on me conduisit √† un fauteil √†√† quelques pas de lui et apr√®s avoir bu un petit verre d\'eau de vie √† sa sant√© et lui un autre √† la mienne, il s\'informa de celle de son fr√®re George, roi d\'Angleterre et me fit quelques questions concernant mon voyage. Nous convers√¢mes ensemble par le moyen de mon domestique qui servait d\'interpr√®te et du Maybou qui d\'abord baisait la terre avant d\'oser r√©p√©ter √† mon domestiques les paroles du roi, coutume qui s\'observe toujours dans tous les lieux du royaumme, de m√™me qu\'en la pr√©sence de sa majest√©, toute les fois qu\'une personne a une occasion de r√©p√©ter ce que le roi a dit ou de d√©livrer quelque ou quelque message de sa part.\"\nL\'auteur d√©crit les moyens mis √† sa disposition par le roi d\'Abomey pour venir √† sa rencontre\nIl d√©crit l\'ensemble du c√©r√©monial d\'introduction d\'un √©tranger √† la cour du roi d\'Abomey, notamment avec la description des pr√©sents qui lui sont faits.\r\nLe Maybou est un conseiller du roi, il a avec le Tam√©ga (vice-roi) le pouvoir de d√©signer le succ√©sseur du roi parmi ses fils √† sa mort. Il est √©galement maitre de c√©r√©monie et dirige toutes les c√©l√©brations publiques de la cour.\nL\'auteur fait mention dans cet extrait de la f√™te des coutumes mais √©galement de la pr√©sence des amazones √† la cour du roi. On y apprend le rituel selon lequel la parole du roi ne peut √™tre r√©p√©t√© sans accomplir certains gestes.\nGattey (Paris)', 2, 1),
(113, 'items', 'Voyage dans l\'int√©rieur de l\'Afrique : fait en 1795, 1796 et 1797. (Avec des) √âclaircissemens sur la g√©ographie de l\'int√©rieur de l\'Afrique.', 'Voyage dans l\'int√©rieur de l\'Afrique : fait en 1795, 1796 et 1797. (Avec des) √âclaircissemens sur la g√©ographie de l\'int√©rieur de l\'Afrique.\n1799\nPark, Mungo\nRennell, James\nhttps://gallica.bnf.fr/ark:/12148/bpt6k103612z?rk=21459;2 Gallica\nDispositifs d\'accueil\nEsclavage\nMungo Park, M√©decin, explorateur. - √âtudie la m√©decine √† Edimburgh et acquiert des connaissances en botanique. Embarque comme aide-chirugien sur un vaisseau de la Compagnie des Indes qui l\'emm√®ne √† Sumatra (1792). Au retour, il r√©dige un m√©moire sur les esp√®ces de\r\nMungo Park arrive √† Joag, premi√®re ville du royaume Kajaaga ou Galam travers√©e. Il s\'agit d\'un royaume Sonink√© dans l\'actuel S√©n√©gal.\r\nP.101 : ¬´ D√®s qu\'il commen√ßa √† faire nuit, on m\'invita √† aller voir les jeux des habitants, parce que la coutume du pays est que, quand il arrive quelque √©tranger, on c√©l√®bre sa venue par des divertissements. Je vis une foule de peuple faisant un grand cercle autour de quelques danseurs. Il y avoir de grands feux allum√©s, et quatre tambours, qui battaient avec beaucoup d\'ensemble et de justesse. ¬ª\r\nMungo Park d√©crit la c√©r√©monie d\'accueil reserv√©e aux √©trangers. On voit qu\'il s\'agit de v√©ritables festivit√©s.\r\nDispositifs d\'accueil\r\npoissons qu\'il y a d√©couvertes. Apr√®s la mort de Houghton, il se met √† la dispotion de l\'African Society pour poursuivre les explorations en vue d\'atteindre le fleuve Niger. Il y parviendra lors des deux voyages qui le rendront c√©l√®bre, et trouvera la mort au cours du second. . - Premier voyage (1795-1797) : parti du comptoir britannique de Pisania, o√π il a appris les rudiments de la langue mandingue, Park traverse le Bondou, le Galam, le Kasso et le Kaarta (royaumes peuls, sarakol√© ou bambara), avant de tomber entre les mains des Maures Ouled\r\nMungo Park, M√©decin, explorateur. - √âtudie la m√©decine √† Edimburgh et acquiert des connaissances en botanique. Embarque comme aide-chirugien sur un vaisseau de la Compagnie des Indes qui l\'emm√®ne √† Sumatra (1792). Au retour, il r√©dige un m√©moire sur les esp√®ces de\r\nVoyage dans l‚Äôint√©rieur de l‚ÄôAfrique. Paris, La D√©couverte, ‚Äúcoll. Litt√©rature de Voyage‚Äù n¬∞ 14, 1996, 354 p.\r\nhttps://gallica.bnf.fr/ark: /12148/bpt6k103612z?rk=21459;2\r\npoissons qu\'il y a d√©couvertes. Apr√®s la mort de Houghton, il se met √† la dispotion de l\'African Society pour poursuivre les explorations en vue d\'atteindre le fleuve Niger. Il y parviendra lors des deux voyages qui le rendront c√©l√®bre, et trouvera la mort au cours du second. . - Premier voyage (1795-1797) : parti du comptoir britannique de Pisania, o√π il a appris les rudiments de la langue mandingue, Park traverse le Bondou, le Galam, le Kasso et le Kaarta (royaumes peuls, sarakol√© ou bambara), avant de tomber entre les mains des Maures Ouled Amar qui le retiennent prisonnier. Il parvient √† s\'√©chapper et atteint le Niger √† S√©gou, capitale d\'un royaume bambara. Il descend alors le fleuve jusqu\'√† Silla, mais ne peut poursuivre au del√† sans risquer de rencontrer √† nouveau l\'hostilit√© des Maures. Il regagne alors son point de d√©part sur la Gambie en passant par Bamako et le pays mandingue. . - Second voyage (1805) : parti de la Gambie avec une petite troupe d\'hommes arm√©s, Park avance jusqu\'√† Bamako malgr√© la saison des pluies et les fi√®vres qui d√©ciment le groupe d\'europ√©ens. A Sansanding, il construit un bateau pour descendre le Niger jusqu\'√† son embouchure. Avant de s\'embarquer, il fait parvenir ses notes en Gambie, puis ne donne plus de nouvelles. Plus tard, un guide mandingue, Isaaco, envoy√© dans l\'int√©rieur pour s\'enqu√©rir du sort de l\'exp√©dition, apprend que Park est arriv√© jusqu\'en pays haoussa avant de p√©rir aux rapides de Boussa, peut-√™tre sous les coups d\'une attaque des riverains. Il √©tait alors √† environ 400 km. de la c√¥te.\nData BnF https://data.bnf. fr/fr/15310152/mungo_park/\nMungo Park arrive √† Joag, premi√®re ville du royaume Kajaaga ou Galam travers√©e. Il s\'agit d\'un royaume Sonink√© dans l\'actuel S√©n√©gal.\nDans la nuit, des cavaliers sont envoy√©s par le roi √† Joag.\nL\'auteur a √©vit√© d\'√™tre amen√© au roi en offrant ses possession aux cavaliers venus le chercher, mais se retrouve sans rien.\nP.101 : ¬´ D√®s qu\'il commen√ßa √† faire nuit, on m\'invita √† aller voir les jeux des habitants, parce que la coutume du pays est que, quand il arrive quelque √©tranger, on c√©l√®bre sa venue par des divertissements. Je vis une foule de peuple faisant un grand cercle autour de quelques danseurs. Il y avoir de grands feux allum√©s, et quatre tambours, qui battaient avec beaucoup d\'ensemble et de justesse. ¬ª\nP.103 : ¬´ Mon h√¥te √©tait pr√©sent. Je lui observai que comme je n\'entendois pas la langue des serawoullis, j\'esp√©rois qu\'on me parleroit mandingue. On y consentit. Alors un petit homme qui avoit sur lui un nombre considerable de saphis, commen√ßa √† me faire une tr√®s-longue harangue, pour me dire que j\'√©tois entr√© dans la ville du roi sans payer les droits et sans faire aucun pr√©sent au monarque ; et que, suivant les lois du pays, mes gens, mes animaux, mes bagages devoient √™tre confisqu√©s. Il ajouta que lui et ses camarades avoient ordre de me mener √† Maana, o√π r√©sidoit le roi, et que je refusois de marcher de bonne volont√©, ils seroient oblig√©s de m\'y conduire par force. ¬ª\nP.108 : ¬´ Vers le soir, j\'√©tois assis sur le bentang, tristement occup√© √† r√©fl√©chir, lorsqu\'une vieille femme esclave passa avec un panier sur la t√™te. Elle me demanda si j\'avois d√Æn√©. Comme je crus qu\'elle vouloit se mosquer de moi, je ne lui r√©pondis pas. Mais mon domestique, qui √©toit √† mes c√¥t√©s, parla pour moi, et lui dit que des gens envoy√©s par le roi m\'avoient d√©rob√© tout mon argent. La bonne femme paroissoit extremement touch√©e de mon d√©sastre, mit son panier √† terre, et me montrant qu\'il contenoit des pistaches, elle me demanda si je pouvois en manger. Je lui dis qu\'oui. Aussitot elle m\'en donna quelques poign√©es et s\'√©loigna avant que j\'eusse le tems de la remercier d\'un secours venu si √† propos.\r\nQuoique cet incident f√ªt de peu de cons√©quence, il me causa beaucoup de satisfaction. Je consid√©rai avec plaisir la conduite d\'une pauvre esclave priv√©e d\'instruction, laquelle, sans me connoitre, n\'avoit eu besoin pour me secourir, que de c√©der √† l\'impulsion de son c≈ìur. Elle savoit par exp√©rience que la faim √©toit une chose cruelle, et ses propres maux l\'avoient rendue sensibles √† ceux des autres. ¬ª\nMungo Park d√©crit la c√©r√©monie d\'accueil r√©serv√©e aux √©trangers. On voit qu\'il s\'agit de v√©ritables festivit√©s.\nL\'auteur raconte de quelle mani√®re il est d√©rob√© de ses possessions. Des cavaliers viennent le chercher pour l\'amener au roi, sous pretexte de n\'avoir pas pay√© de droit de passage. En offrant aux cavaliers ses possessions, Mungo Park √©vite d\'√™tre amen√© au roi.\nL\'auteur se retrouve sans possibilit√© de se nourrir, une esclave lui vient en aide. L\'auteur d√©crit alors son ressenti par rapport √† ce geste et montre une grande satisfaction √† constater que malgr√© le manque d\'instruction, l\'esclave montre de la compassion √† son √©gard.\nDentu et Carteret (Paris)', 2, 1),
(114, 'items', 'Voyage au Dahomey', 'Voyage au Dahomey\n1879 \nDubarry, Armand \nhttps://gallica.bnf.fr/ark:/12148/bpt6k103732z Gallica\nmonographie imprim√©e \nCroyances\nDubarry, Armand (1836-1910?).\r\n√âcrivain, litt√©rateur et journaliste. - Auteur de po√©sies, romans, contes, voyages etc. Il a effectu√© un voyage au Dahomey.\nLe r√©cit de Dubarry est un r√©cit d\'exploration fictif qui met en sc√®ne deux personnages partis de France.\nP.93 : ¬´ La religion du n√®gre est comme sa vie, d√©cousue, insens√©e.\r\nTout ce qui frappe son esprit, son sens, est pour lui un sujet d\'adoration, si bien que son culte est d\'une vari√©t√©, d\'une √©tranget√© infinies : arbre, brin d\'herbe, l√©gume, fruit, coquillage, caillou, verroterie, serpent, lion, l√©opard, crocodile, l√©zard, √©l√©phant, astres, etc., sont ses f√©tiches, ses idoles. ¬ª\nTout au long de l\'ouvrage, et au sein de cet extrait, transparait un jugement de l\'auteur sur le mode de vie et les croyances du peuple du Dahomey. On voit clairement l\'√©volution de point de vue entre les r√©cits des premiers explorateurs et ceux du 19√®me si√®cle, emprunt d\'une id√©ologie ¬´ civilisatrice ¬ª. Il g√©n√©ralise une image n√©gative des populations noires.', 2, 1),
(115, 'items', 'Sept ans en Afrique occidentale : la c√¥te des esclaves et le Dahomey', 'Sept ans en Afrique occidentale : la c√¥te des esclaves et le Dahomey\n1885\nBouche, Pierre\nhttps://gallica.bnf.fr/ark:/12148/bpt6k103362r Gallica\nmonographie imprim√©e \nAucun th√®me, mais passage int√©ressant.\nDispositifs d\'accueil\nBouche, Pierre (1835-1903), Pr√™tre, membre de la Soci√©t√© des missions africaines.\nL\'abb√© Bouche introduit son r√©cit.\nL\'abb√© Bouche est re√ßu par le Yevogan, vice-roi de Ouidah.\nR√¥le Interpr√®te.\nUsages.\nL\'√©tranger chez les n√®gres.\nP.14 : ¬´ D√®s min arriv√©e √† la c√¥te des Esclaves, j\'√©crivais √† mon jeune fr√®re, qui faisait alors ses √©tudes : ¬´ les livres te montrent le noir toujours courb√©, sous le fouet, toujours pr√™t √† se jeter sur ses ma√Ætres, insociable, √©tranger presque √† tout sentiment humain. Ce noir, je ne le vois pas ici : c\'est le noir des colonies, arrach√© violemment √† son pays, √† ses parents, men√© comme une brute, avili sous le joug. Ici le noir est chez lui ; et, m√™me au milieu des abaissements et de la d√©gradation inh√©rents √† l\'idol√¢trerie, il conserve, empreints dans son caract√®re et dans ses habitudes, les signes non √©quivoques de la dignit√© humaine. Il vit avec ses semblables ; il a sa religion et son culte ; il a ses pr√™tres, son roi, ses chefs, etc. ¬ª\r\nLa v√©rit√© s\'imposait √† moi, lorsque je tra√ßais ces lignes : le n√®gre ne me paraissait pas vil et m√©prisable, comme le pr√©sentent les r√©cits de certains voyageurs et les syst√®mes des anthropologistes. Nous sommes h√©las ! Habitu√©s √† voir le n√®gre √† travers le prisme des pr√©jug√©s m√©prisants. On l\'a raval√© dans l\'opinion ; on a accumul√© sur son compte tant d\'id√©es fausses, absurdes, r√©voltantes, qu\'il est presque impossible de reconna√Ætre l\'homme en lui.\r\nEtudions-le de pr√®s, dans ses usages et dans ses institutions, et nous verrons combien il est injuste de l\'exclure de la grande famille humaine. ¬ª\nP.67 : ¬´ D√®s que nous sommes arriv√©s chez le y√©vogan, un de ses serviteurs nous a accueillis √† la porte, et nous a imm√©diatement introduits dans la cour int√©rieure, o√π le chef re√ßoit les visites. L√†, il a re√ßu de nous la canne que nous tenions √† la main ; nous l\'avons charg√© d\'offrir nos hommages au cab√©c√®re, et de lui maifester notre d√©sir de le voir. ¬´ Dis lui, ai-je ajout√©, que je viens lui pr√©senter ce P√®re, arriv√© depuis peur de jours de la terre des blancs ¬ª. Le serviteur, nous ayant pr√©sent√© des chaises, a disparu dans l\'int√©rieur, emportant nos cannes. Il est revenu bient√¥t, nous a salu√©s de la part de son ma√Ætre et nous a pri√©s d\'attendre. Il ne rapportait pas nos cannes, ce qui voulait dire que nous allions √™tre admis. Le y√©vogan n\'a pas tard√© √† para√Ætre, accompagn√© de deux des siens et suivi d\'une jeune fille arm√©e d\'un √©ventail. Lui-m√™me portait nos cannes ; il nous les a rendues apr√®s nous avoir donn√© une poign√©e de main √† chacun, puis nous invitant √† nous assoir, il s\'est √©tendue sur une natte pos√©e √† terre. ¬ª\nP.68 : ¬´ G√©n√©ralement on ne parle que par interpr√®te au y√©vogan et aux autres chefs : c\'est une rubrique du c√©r√©monial des reception dont on a de la peine √† s\'affranchir. Les chefs sont entour√©s d\'espions qui, de la sorte, entendent tout ce qu\'on dit. De plus, l\'interpr√®te adoucit dans sa traduction les mots durs ou blessants de l\'interlocuteur √©tranger. Les indig√®nes seuls parlent directement aux chefs en langue du pays. Si un blanc converse avec eux autrement que par interpr√®te, ce n\'est jamais que dans l\'intimit√© et en l\'absence d\'espions. ¬ª\nP.69 : ¬´ L\'usage du pays veut que l\'on ne re√ßoive pas un ami sans lui offrir √† boire : l\'√©tiquette exige que l\'ami ne refuse point. En offrant, celui que l\'on visite a soin de montrer qu\'il n\'a aucune mauvaise intention ; refuser serait avoir l\'air de se d√©fier ; dans le style et les usages du pays, ce serait presque dire √† son h√¥te ¬´ qui sait ? Peut-√™tre veux-tu m\'enpoisonner ¬ª. Le y√©vogan donc √† fait porter √† boire et nous avons bu. Voici comment les choses se sont pass√©es : un serviteur est arriv√©, tenant √† la main un plateau sur lequel √©taient trois verres, une bouteille d\'eau et un flacon de gin. Apr√®s avoir pos√© le plateau, il a vers√© de l\'eau dans un verre ; puis il a pass√© cette eau dans les deux autres verres, de mani√®re √† lui en faire toucher les parois int√©rieures, et il a bu l\'eau. Il nous disait √† sa mani√®re : ¬´ Voyez ! Ni l\'eau, ni les verres ne cachent la mort. ¬ª Servant ensuite de l\'eau √† tous, il nous mettait en demeure de nous prononcer nous m√™mes. Ne pas boire eut √©t√© un signe de d√©fiance dont le y√©vogan aurait eu le droit de se formaliser. ¬ª\np.400 : ¬´ Voici les principes sur lesquels sont bas√©s les relations du Dahomey avec les blancs :\r\n1¬∞ Les blancs n\'entrent au Dahomey que par pure tol√©rance.\r\n2¬∞ Ils n\'en peuvent sortir sans la permission du roi ou des chefs, et apr√®s s\'√™tre fait ouvrir les chemins par eux.\r\n3¬∞ Nul ne s\'√©tablit dans le royaume qu\'avec la permission expresse du roi\r\n4¬∞ On n\'est pas libre de circuler √† l\'int√©rieur √† moins de s\'y √™tre fait autoriser. 5¬∞ Quinconque veut se livrer au n√©goce doit se faire ouvrir les chemins POUR LE COMMERCE ; les autorit√©s se r√©servant toujours le droit de les lui fermer, quand bon leur semblera.\r\n6¬∞ Les n√©gociants ne sont pas libres d\'acheter les produits du pays dont l\'exportation n\'a pas √©t√© approuv√©e. On leur d√©fend de vendre certaines marchandises, l\'√©toffe du roi, par exemple. Il y en a d\'autres qu\'on ne leur permet pas de vendre en d√©tail, le droit de les d√©tailler √©tant un privil√®ge r√©serv√© aux gens de l\'endroit.\r\n7¬∞ Quelques fois la valeur de certains produits exotiues varie, de telle sorte que le n√©gociant est oblig√© de hausser notablement ses prix. Ce changement de prix, si bien motiv√© qu\'il soit, expose √† des palavres et √† de fortes amendes.\nP.403 : ¬´ En terminant, qu\'il nous soit permis de d√©plorer l\'influence pernicieuse des blancs au Dahomey. En s\'adonnant √† la traite, ils ont rendu n√©cessaire la chasse √† l\'homme. N\'est-ce pas la traite des n√®gres qui a fait du monarque dahom√©en un roi brigand, et de ses sujets une bande de pillards ? Il est temps de traiter les noirs en hommes. Cessons de les consid√©rer comme une race inf√©rieure et maudite. Ils ont leur dignit√©, leurs lois, leur droit : respectons-les. Le noir a sa place dans la grande famille humaine : nous avons eu le tort de l\'en exclure ; qu\'il n\'en soit plus ainsi d√©sormais. ¬ª\nL\'auteur remit en cause les pr√©jug√©s diffus√©s en Europe sur les Africains. Il se place clairement contre la traite. Montre un point de vue diff√©rent √† un moment o√π les pr√©jug√©s n√©gatifs sont largement admis.\nDescription du c√©r√©monial d\'accueil des √©trangers par le Y√©vogan, avec un certain nombre de rites de salutations.\nL\'abb√© Bouche d√©crit ici le r√¥le fondamental dans l\'interpr√®te dans les rencontres avec les chefs africains. Ils ne peuvent converser sans lui.\nDescription du c√©r√©monial li√© √† la boisson. Outre le fait d\'offrir √† boire √† son invit√©, ce c√©r√©monial sert √† prouver que les deux protagonistes peuvent se faire confiance.\n√Ä la fin de son ouvrage, l\'abb√© bouche relate les r√®gles strictes auxquelles sont soumis les √©trangers au Dahomey. Les blancs sont accueillis sur ce territoire mais n\'y sont pas libres de leurs mouvements.\nDerni√®re phrase de l\'ouvrage. L\'abb√© Bouche se place clairement contre la traite et d√©nonce le r√¥le des europ√©ens.', 2, 1),
(116, 'items', 'Trois mois de captivit√© au Dahomey', 'Trois mois de captivit√© au Dahomey\n1891 \nChaudoin, E.\nhttps://gallica.bnf.fr/ark:/12148/bpt6k6220864x Gallica\nmonographie imprim√©e\nDispositifs d\'accueil\nEdmond Chaudoin, a √©t√© fait prisonnier par le roi B√©hanzin en 1890, avant de devenir administrateur colonial. Son ouvrage est un r√©cit de voyage relatant ses trois mois de captivit√©.\nL\'auteur quitte Marseille pour se rendre au Dahomey. Apr√®s un arr√™t √† Dakar et √† Grand-Popo, il d√©barque √† Ouidah en tant que commer√ßant.\nP.27 : Wydah-Plage\r\n\"[...] le roi ne permet pas aux Europ√©ens d\'habiter √† la plage, et d√®s que le soleil se coucge, ces derniers sont oblig√©s de rentrer √† Wydah-ville. Dans quel but cette interdiction? Je n\'ai jamais pu avoir une r√©ponse des gens du pays √† cet √©gars; ils se contentent de dire \"Le roi le d√©fend.\" La v√©ritable raison, √† mons avis et nous en avons eu la preuve, r√©side dans une question de s√©curit√© g√©n√©rale. Le roi craint que pendant la nuit les Europ√©ens restant √† la plage n\'entretiennent des relations avec les navires de guerre et les gens des Popos qui sont fran√ßais et ennemis du Dahomey, et ne favorisent ainsi l\'envahissement possible du pays; tandis qu\'oblig√©s de coucher √† la ville, les Europ√©ens sont tr√®s bien surveill√©s et il leur est impossible de sortir du Dahomey sans l\'assentiment des autorit√©s.\"\nChaudoin par cette description des r√®gles de vie au Dahomey r√©v√®le la m√©fiance du roi vis-√†-vis des Europ√©ens pr√©sents sur son territoire.', 2, 1),
(117, 'items', 'Le Tour du monde : nouveau journal des voyages', 'Le Tour du monde : nouveau journal des voyages\n1863\nCharton, √âdouard\nhttps://gallica.bnf.fr/ark:/12148/bpt6k34382j/f77.image Gallica\npublication en s√©rie imprim√©e\nDispositifs d\'accueil\nM. le Dr R√©pin, ex-chirurgien de la Marine Imp√©riale. Son r√©cit est tir√© de ses carnets de voyage.\nL\'auteur d√©crit dans son ouvrage plusieurs voyages r√©alis√©s √† travers le monde. Pour se rendre au Dahomey, il quitte Brest, passe par Gor√©e puis arrive √† Ouidah.\np. 74 : \"Pr√©venu de notre arriv√©e, Gh√©zo, monarque alors r√©gnant sur le Dahomey, envoya √† Wydah l\'un de ses aides de camp pour nous saluer et nous donner la route, car aucun √©tranger ne peut p√©n√©trer dans l\'int√©rieur sans l\'expresse permission du roi. Cet officier arriva le 12 octobre, et pr√©senta au capitaine Vallon la canne royale, insigne des fonctions dont il √©tait charg√©. C\'est une des coutumes de ce pays, o√π l\'√©criture est inconnue, que l\'envoy√© d\'un roi ou d\'un seigneur soir porteur d\'un signe visible de la confiance de son ma√Ætre. Le plus souvent c\'est une canne plus ou moins √©l√©gante que le messager remet entre les mains de celui vers lequel il est envoy√©, pendant qu\'il s\'acquitte aupr√®s de lui de sa mission. Il la reprend ensuite, car c\'est une sorte de passe port qui lui assure partout o√π il passed le respect ey l\'ob√©issance due au souverain, et il la remet √† son maire en lui rendant compre de l\'√©xecution de ses ordres.\"\nL\'auteur d√©crit le rituel de rencontre entre √©trangers et envoy√© du roi. Cette description recoupe celles faites par d\'autres auteurs, notamment l\'Abb√© Bouche.', 2, 1),
(118, 'items', 'Le Dahom√© : souvenirs de voyage et de mission', 'Le Dahom√© : souvenirs de voyage et de mission\n1873\nLaffitte, J. (Abb√©)\nhttps://gallica.bnf.fr/ark:/12148/bpt6k6209298w/f81.image Gallica\nmonographie imprim√©e \nDispositifs d\'accueil\nL\'Abb√© Laffitte part de Lyon pour se rendre √† Liverpool afin de rejoindre un bateau √† Destination du Dahomey.Il arrive √† Lagos pour se rendre ensuite √† Ouidah\nP.43: \" Quoique le th√© e√ªt perdu de sa saveur, je le trouvais excellent. Pendant que je le d√©gustais, un jeune noir qui venait d\'entrer s\'approcha de moi, et le salua √† la fran√ßaise:\r\n\"Bonjour Monsieur, moi parler fran√ßais.\r\n- Ah! Tu parles fran√ßais, toi ? lui dis-je.\r\n- Oui, Monsieur, me r√©pondit-il.\r\n- O√π donc l\'as-tu appris ?\r\n- A la factorie fran√ßaise de Whydah; moi pas savoir beaucoup, mais savoir assez pour parler avec Monsieur.\r\n- Sois le bien venu, mon ami, car j\'ai grand besoin de toi.\"\r\nSans lui, en effet, il m\'e√ªt √©t√© presque impossible d\'organiser mon d√©part pour Whydah.\r\n[...]La soir√©e √©tant d√©j√† tr√®s avanc√©e, je jugeai que le moment √©tait venu de traiter la question de mon voyage. Je commencais √† peine √† exposer mon dessein que le cabac√®re m\'arr√™ta en disant : \"Je ne veux pas que tu partes ce soir, on dirait que je t\'ai mis dehors; ce sera un grand honneur pour moi de te garder jusqu\'√† demain.\" Parlait-il sinc√®rement? J\'aime √† le croire. Mais je me gardai bien d\'accepter une invitation si aimabke: une nuit √† passer dans un taudis n\'avait rien d\'attrayant. Je pr√©ferai continuer mon voyage. Je priai le chef de me procurer quatre n√®gres vigoureux et un hamac; l\'interpr√®te fut charg√© de ce soin.\"\nDans cet extrait l\'auteur d√©crit l\'hospitalit√© dont il fait l\'objet, ainsi que les moyens humains mis √† sa disposition pour la poursuite de son voyage.', 2, 1),
(119, 'items', 'Souvenirs de la campagne du Dahomey', 'Souvenirs de la campagne du Dahomey\n1896\nSchelameur, Fr√©d√©ric\nhttps://gallica.bnf.fr/ark:/12148/bpt6k64645409/f55.item.zoom Gallica\nmonographie imprim√©e\nDispositifs d\'accueil\nFr√©d√©ric Schelameur, v√©t√©rinaire √† la l√©gion √©trang√®re.\nLa campagne du Dahomey a lieu entre 1892 et 1894 et oppose les troupes fran√ßaise de la l√©gion √©trang√®re, men√©e par le colonel Dodds, au royaume Fon de B√©hanzin. B√©hanzin se rend le 15 janvier 1894 et est exil√© en Martinique.\r\nFr√©d√©ric Schelameur fait partie des troupes envoy√©es au Dahomey dans ce cadre. A son arriv√©e √† Cotonou, la ville est d√©j√† aux mains des fran√ßais. Il y est donc accueilli par des compatriotes.\nP.47: \"Nous voici donc √† Kotonou! ... Les camarades de l\'escadron nous attendent au d√©barcad√®re; on √©change quelques cordiales poign√©es de main, et, comme c\'est l\'heure du d√©jeuner, nous nous dirigeons volontiers vers la popote, qui a √©t√© insatll√©e dans une petite annexe de l\'√©tablissement deu t√©l√©graphe anglais. Les trois employ√©s, nos compatriotes, nous acceuillent avec la m√™me courtoisie, la m√™me affabilit√© qu\'ils ont d√©j√† t√©moign√© aux officiers du premier d√©tachement. Le directeur, M. Bonnard, s\'est mis √ß notre enti√®re disposition avec tout ce qu\'il poss√®de, ses adjoints font chorus.\nH. Charles-Lavauzelle (Paris)', 2, 1),
