(358, 'items', 'guides', 'guides\ninterlocuteurs\n ce sont les sp√©cialistes du contenu, ceux qui peuvent contextualiser le contenu et donner des informations utiles √† son sujet. En clair, cela permet √† chacun d‚Äôentre nous de donner, sous forme imag√©e, narrative, po√©tique, des informations sur le ou les √©l√©ments du corpus que nous proposons.', 1, 1),
(359, 'items', '√©trangers', '√©trangers\ninterlocuteurs\nce sont justement les non sp√©cialistes du contenu. En clair, cela permet √† chacun d‚Äôentre nous de r√©agir au corpus propos√© par les autres et de faire vivre l‚Äôinterculturalit√©, voire la barri√®re culturelle et les incompr√©hensions qui y sont inh√©rentes. Nous pouvons ici exprimer des opinions initiales avant discussion, voire des opinions ¬´ communes ¬ª que nous percevons chez nos concitoyens comme autant de barri√®res dans le rapport au corpus de ¬´ l‚Äôautre ¬ª.', 1, 1),
(360, 'items', 'h√©ros', 'h√©ros\nil faudra en d√©terminer les caract√©ristiques. Il est n√©cessairement curieux. Je propose que sa qu√™te, qui justifie le road movie, soit la d√©couverte des formes de langage puisque chaque √©l√©ment du corpus, quel qu‚Äôil soit, est un √©nonc√© (m√™me si c‚Äôest un objet) qui s‚Äôexprime dans un langage donn√©. Le h√©ros dans ce cas ne gagne ni ne perd rien, il d√©couvre simplement et est l‚Äôoccasion d‚Äôun √©change indirect entre les guides et les √©trangers, ce qui √©vite le d√©bat entre ces deux types de personnages. Le h√©ros, finalement, est la m√©taphore m√™me de notre projet et on peut exprimer √† travers lui tout ce qui se joue dans le projet global ; la production num√©rique est ainsi un √©l√©ment r√©flexif du projet sur lui-m√™me, fournissant un mode cr√©atif et totalement in√©dit, typiquement ArTeC, de publication des r√©sultats du projet.', 1, 1),
(361, 'items', 'h13', 'h13\nlors d‚Äôun dialogue, un guide ne peut donner au h√©ros qu‚Äôune information parcellaire sur le contenu, un point de vue, une anecdote‚Ä¶ diff√©rente de celles d√©j√† donn√©es par les guides', 1, 1),
