(112, 2, 6, 'Annotation', 'Annotation', 'The class for Web Annotations.'),
(113, 2, 6, 'Choice', 'Choice', 'A subClass of  as:OrderedCollection  that conveys to a consuming application that it should select one of the resources in the  as:items  list to use, rather than all of them.  This is typically used to provide a choice of resources to render to the user, based on further supplied properties.  If the consuming application cannot determine the user\'s preference, then it should use the first in the list.'),
(114, 2, 6, 'CssSelector', 'CssSelector', 'A CssSelector describes a Segment of interest in a representation that conforms to the Document Object Model through the use of the CSS selector specification.'),
(115, 2, 6, 'CssStyle', 'CssStyle', 'A resource which describes styles for resources participating in the Annotation using CSS.'),
(116, 2, 6, 'DataPositionSelector', 'DataPositionSelector', 'DataPositionSelector describes a range of data by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first byte, position 1 would be immediately before the second byte, and so on. The start byte is thus included in the list, but the end byte is not.'),
(117, 2, 6, 'Direction', 'Direction', 'A class to encapsulate the different text directions that a textual resource might take.  It is not used directly in the Annotation Model, only its three instances.'),
(118, 2, 6, 'FragmentSelector', 'FragmentSelector', 'The FragmentSelector class is used to record the segment of a representation using the IRI fragment specification defined by the representation\'s media type.'),
(119, 2, 6, 'HttpRequestState', 'HttpRequestState', 'The HttpRequestState class is used to record the HTTP request headers that a client SHOULD use to request the correct representation from the resource. '),
(120, 2, 6, 'Motivation', 'Motivation', 'The Motivation class is used to record the user\'s intent or motivation for the creation of the Annotation, or the inclusion of the body or target, that it is associated with.'),
(121, 2, 6, 'RangeSelector', 'RangeSelector', 'A Range Selector can be used to identify the beginning and the end of the selection by using other Selectors. The selection consists of everything from the beginning of the starting selector through to the beginning of the ending selector, but not including it.'),
(122, 2, 6, 'ResourceSelection', 'ResourceSelection', 'Instances of the ResourceSelection class identify part (described by an oa:Selector) of another resource (referenced with oa:hasSource), possibly from a particular representation of a resource (described by an oa:State). Please note that ResourceSelection is not used directly in the Web Annotation model, but is provided as a separate class for further application profiles to use, separate from oa:SpecificResource which has many Annotation specific features.'),
(123, 2, 6, 'Selector', 'Selector', 'A resource which describes the segment of interest in a representation of a Source resource, indicated with oa:hasSelector from the Specific Resource. This class is not used directly in the Annotation model, only its subclasses.'),
(124, 2, 6, 'SpecificResource', 'SpecificResource', 'Instances of the SpecificResource class identify part of another resource (referenced with oa:hasSource), a particular representation of a resource, a resource with styling hints for renders, or any combination of these, as used within an Annotation.'),
(125, 2, 6, 'State', 'State', 'A State describes the intended state of a resource as applied to the particular Annotation, and thus provides the information needed to retrieve the correct representation of that resource.'),
(126, 2, 6, 'Style', 'Style', 'A Style describes the intended styling of a resource as applied to the particular Annotation, and thus provides the information to ensure that rendering is consistent across implementations.'),
(127, 2, 6, 'SvgSelector', 'SvgSelector', 'An SvgSelector defines an area through the use of the Scalable Vector Graphics [SVG] standard. This allows the user to select a non-rectangular area of the content, such as a circle or polygon by describing the region using SVG. The SVG may be either embedded within the Annotation or referenced as an External Resource.'),
(128, 2, 6, 'TextPositionSelector', 'TextPositionSelector', 'The TextPositionSelector describes a range of text by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first character, position 1 would be immediately before the second character, and so on.'),
(129, 2, 6, 'TextQuoteSelector', 'TextQuoteSelector', 'The TextQuoteSelector describes a range of text by copying it, and including some of the text immediately before (a prefix) and after (a suffix) it to distinguish between multiple copies of the same sequence of characters.'),
(130, 2, 6, 'TextualBody', 'TextualBody', ''),
(131, 2, 6, 'TimeState', 'TimeState', 'A TimeState records the time at which the resource\'s state is appropriate for the Annotation, typically the time that the Annotation was created and/or a link to a persistent copy of the current version.'),
(132, 2, 6, 'XPathSelector', 'XPathSelector', ' An XPathSelector is used to select elements and content within a resource that supports the Document Object Model via a specified XPath value.'),
