(21, 8, 1, NULL, 'literal', '', '¬´ Lire ensemble ¬ª √† l\'√©preuve du terrain : premi√®res conclusions', NULL, 1),
(22, 8, 91, NULL, 'literal', '', 'L‚Äôenqu√™te de terrain men√©e au B√©nin entre le 25 avril et le 1 er mai permet de confronter √† l‚Äô√©preuve du terrain notre probl√©matique, peut-on lire ensemble dans un monde num√©rique ?', NULL, 1),
(23, 8, 91, NULL, 'literal', '', 'La BNF a mis √† notre disposition un riche catalogue de textes d‚Äôexplorateurs, datant du XV√®me au XX√®me si√®cle. De ce corpus a √©t√© cr√©√© un catalogue d‚Äôextraits centr√© sur la d√©couverte de l‚ÄôAfrique, du Dahomey et plus particuli√®rement ax√© sur le th√®me des dispositifs d‚Äôaccueil mis en place. Comment accueille-t-on l‚ÄôAutre ?', NULL, 1),
(24, 8, 91, NULL, 'literal', '', 'Cette s√©lection a permis de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚ÄôAutre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque : un point de vue qui sera dit ‚Äúdescriptif‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique, un point de vue dit ‚Äúcivilisateur‚Äù servant la justification de l‚Äôesclavage et un point de vue dit ‚Äúabolitionniste‚Äù. Cette √©volution suit une chronologie claire applicable au B√©nin, anciennement Dahomey.', NULL, 1),
(25, 8, 91, NULL, 'literal', '', 'Lors de notre enqu√™te de terrain, nous proposons √† nos enqu√™t√©s de lire, sur support √©lectronique, une s√©quence de trois extraits, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun d‚Äôentre eux et recueillons leurs r√©actions spontan√©es. Une fois cette premi√®re r√©action recueillie, nous leur pr√©sentons les interfaces par l‚Äôinterm√©diaire de vid√©os sur tablettes ou t√©l√©phones, en expliquant leur utilit√© et le concept d‚Äôinterface qui peut √™tre tr√®s abstrait pour qui n‚Äôest pas initi√©. Comment y r√©agissent-ils ?', NULL, 1),
(26, 8, 91, NULL, 'literal', '', 'Le troisi√®me temps de cette enqu√™te est celui des r√©cits de vie. Il s‚Äôagit d‚Äôun temps du discours long pendant lequel l‚Äôenqu√™teur s‚Äôefface pour laisser la place au r√©cit de l‚ÄôAutre et le recueillir. Nous demandons aux personnes interrog√©es de nous raconter ce √† quoi elles pensent lorsque nous pr√©sentons notre sujet, mais √©galement de nous pr√©senter un objet qui leur semble important et d‚Äôen parler.', NULL, 1),
(27, 9, 1, NULL, 'literal', '', 'Extrait 1 Ouidah Bertin Calixte Biah', NULL, 1),
(28, 9, 2, NULL, 'literal', '', 'Katia Guibert', NULL, 1),
(29, 9, 7, NULL, 'literal', '', '2019-07-09', NULL, 1),
(30, 9, 8, NULL, 'literal', '', 'mov', NULL, 1),
(31, 10, 1, NULL, 'literal', '', 'Diaporamas pr√©sentation colloque 2 mai 2019', NULL, 1),
(32, 10, 2, NULL, 'literal', '', 'Ana√Øs Ramalho', NULL, 1),
(33, 10, 7, NULL, 'literal', '', '2 mai 2019', NULL, 1),
(34, 10, 4, NULL, 'literal', '', 'Support visuel de la pr√©sentation du projet ¬´ Lire ensemble ¬ª lors d\'un colloque.', NULL, 1),
(35, 10, 8, NULL, 'literal', '', 'pptx', NULL, 1),
(36, 11, 1, NULL, 'literal', '', 'Texte pr√©sentation colloque 2 mai 2019', NULL, 1),
(37, 11, 91, NULL, 'literal', '', 'Probl√©matique de l‚Äôenqu√™te de terrain : \r\nL‚Äôenqu√™te de terrain men√©e au B√©nin entre le 25 avril et le 1er mai permet de confronter √† l‚Äô√©preuve du terrain notre probl√©matique, peut-on lire ensemble dans un monde num√©rique ?\r\nLa BNF a mis √† notre disposition un riche catalogue de textes d‚Äôexplorateurs, datant du XV√®me au XX√®me si√®cle. A la fin de ces six jours d‚Äôenqu√™tes, quels √©l√©ments de r√©ponses pouvons-nous apporter ?\r\nNous nous sommes pos√© la question de la mise en alt√©rit√©, fabrication d‚Äôune image de l‚ÄôAfrique par le regard occidental. Jusqu‚Äô√† quel point s‚Äôy fier ? Comment recueillir des contre-r√©cits qui nous permettrait de recentrer ? D√©placement de perspective qui ne met plus l‚Äôhomme europ√©en au centre mais plut√¥t l‚Äôhistoire locale.', NULL, 1),
(38, 11, 91, NULL, 'literal', '', '1) Pr√©sentation de la m√©thode de s√©lection des extraits de textes issus du corpus Afrique :', NULL, 1),
(39, 11, 91, NULL, 'literal', '', '-  Choix des axes :', NULL, 1),
(40, 11, 91, NULL, 'literal', '', 'Le travail que j‚Äôai r√©alis√© a √©t√© celui de s√©lectionner dans un premier temps une cinquantaine d‚Äôextraits avec comme prismes de lecture 3 axes omnipr√©sents dans ces textes : les dispositifs d‚Äôaccueil d√©ploy√©s, les croyances et l‚Äôesclavage.', NULL, 1),
(41, 12, 1, NULL, 'literal', '', 'Protocole enqu√™te au B√©nin.', NULL, 1),
(42, 12, 91, NULL, 'literal', '', '1) M√©thode :', NULL, 1),
(43, 12, 91, NULL, 'literal', '', 'Un travail de s√©lection d‚Äôextraits de textes a √©t√© r√©alis√© en amont de l‚Äôenqu√™te de terrain. Ceux-ci ont permis de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚Äôautre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque : un point de vue dit ‚Äúneutre‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique, un point de vue dit ‚Äúcivilisateur‚Äù servant la justification de l‚Äôesclavage et un point de vue dit ‚Äúabolitionniste‚Äù. Cette √©volution suit une chronologie claire applicable au B√©nin, anciennement Dahomey.', NULL, 1),
(44, 12, 91, NULL, 'literal', '', 'Apr√®s avoir cr√©√© cette s√©quence de points de vue, nous proposerons √† nos enqu√™t√©s de les lire, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun de ces extraits. Il faudrait id√©alement que l‚Äôenqu√™teur n‚Äôintervienne pas et afin de recueillir la r√©action spontan√©e de l‚Äôenqu√™t√©. Si toutefois l‚Äôenqu√™t√© ne r√©agissait pas, l‚Äôenqu√™teur devra poser des questions larges du type ‚Äúqu‚Äôen pensez-vous?‚Äù, ‚Äú√† quoi cela vous fait penser ?‚Äù. ', NULL, 1),
(45, 13, 1, NULL, 'literal', '', 'S√©lections d\'extraits textuels.', NULL, 1),
(46, 13, 2, NULL, 'literal', '', 'Katia Guibert', NULL, 1),
(47, 13, 7, NULL, 'literal', '', '2019-04-02', NULL, 1),
(48, 13, 8, NULL, 'literal', '', 'pdf', NULL, 1),
(49, 14, 1, NULL, 'literal', '', 'Extrait 1 Ouidah Camille Capo Chichi', NULL, 1),
(50, 14, 2, NULL, 'literal', '', 'Katia Guibert', NULL, 1),
(51, 14, 8, NULL, 'literal', '', 'mov', NULL, 1),
(52, 24, 1, NULL, 'literal', NULL, '¬´ Lire ensemble ¬ª √† l\'√©preuve du terrain : premi√®res conclusions', NULL, 1),
(53, 25, 1, NULL, 'literal', NULL, 'S√©lections d\'extraits textuels', NULL, 1),
(54, 26, 1, NULL, 'literal', '', 'Historial description de l\'Afrique, tierce partie du monde. 1', NULL, 1),
(55, 11, 91, NULL, 'literal', '', 'Apr√®s discussion et r√©flexion sur la suite du projet avec l‚Äô√©quipe et dans la perspective de l‚Äôenqu√™te de terrain nous avons orient√© la s√©lection pour le corpus propre au Dahomey sur les dispositifs d‚Äôaccueil. L‚Äôid√©e √©tant que les 2 autres axes pouvaient provoquer des r√©ticences de la part des enqu√™t√©s, car il s‚Äôagit de deux th√®mes faisant partie prenante de la cr√©ation d‚Äôun mythe autour de la religion de l‚ÄôAfricain et de l‚Äôesclavage.', NULL, 1),
(56, 11, 91, NULL, 'literal', '', 'De ce corpus a √©t√© cr√©√© un catalogue d‚Äôextraits centr√© sur la d√©couverte de l‚ÄôAfrique, du Dahomey et plus particuli√®rement ax√© sur le th√®me des dispositifs d‚Äôaccueil mis en place, spatialement et socialement. Comment accueille-t-on l‚ÄôAutre ? Contextualisation √† la fois de l‚Äôauteur-locuteur et de ses pr√©suppos√©s id√©ologiques, de la place de l‚Äôextrait dans l‚Äôouvrage et donc en g√©n√©ral de sa place dans le voyage, et une interpr√©tation.', NULL, 1),
(57, 11, 91, NULL, 'literal', '', 'En nous demandant quel √©tait le parti pris de l‚Äôauteur dans chacune de ces oeuvres, il a √©t√© possible de d√©terminer une √©volution du regard europ√©en sur ‚Äúl‚ÄôAutre‚Äù et en particulier sur les Africains. On distingue trois points de vue, chacun correspondant √† une √©poque :', NULL, 1),
(58, 11, 91, NULL, 'literal', '', 'un point de vue qui sera dit ‚Äúdescriptif‚Äù lors des premi√®res d√©couvertes de l‚ÄôAfrique -> √† ce moment le blanc n‚Äôest pas encore colon, il d√©couvre un nouveau territoire avec sa population et ses cultures donc l‚Äôasym√©trie des pouvoirs ne penche pas dans son sens, un point de vue dit ¬´ civilisateur ¬ª servant la justification de l‚Äôesclavage\r\n-> passage de la souverainet√© de l‚Äôafricain √† la non souverainet√©, et un point de vue dit ¬´ abolitionniste ¬ª\r\n-> dans certains propos tente de ramener aux premiers discours, mais la dimension de s√©paration raciale ne le permet pas. Perception de l‚Äôasym√©trie de pouvoir dont parlait Clemens Zobel.', NULL, 1),
(59, 11, 91, NULL, 'literal', '', 'Cette √©volution du regard de l‚Äôeurop√©en que les territoires et populations qu‚Äôil ‚Äúd√©couvre‚Äù (terme √† ne pas lire au sens propre pour tous les auteurs, ne sont pas tous des explorateurs) suit une chronologie claire applicable √† l‚Äôhistoire du Dahomey.', NULL, 1),
(60, 11, 91, NULL, 'literal', '', 'L‚Äôaccueil est le premier point de contact, donc potentiellement de tension, or ce n‚Äôest pas ce qui ressort des r√©cits. La tension vient plus tard, dans l‚Äô√©change et dans le vivre ensemble.', NULL, 1),
(61, 11, 91, NULL, 'literal', '', '2) Pr√©paration de l‚Äôenqu√™te √† partir de la s√©lection : que veut on savoir ?', NULL, 1),
(62, 11, 91, NULL, 'literal', '', 'Comment lire les textes d‚Äôexplorateurs dans une approche interculturelle ?', NULL, 1),
(63, 11, 91, NULL, 'literal', '', 'L‚Äôhistoire est commune mais nos r√©cits parlent-ils aux int√©ress√©s ? ', NULL, 1),
(64, 11, 91, NULL, 'literal', '', 'Comment collecter des contre r√©cits (lien avec Arnaud) ?', NULL, 1),
(65, 11, 91, NULL, 'literal', '', 'Quelle valeur leur accorder ?', NULL, 1),
(66, 11, 91, NULL, 'literal', '', 'Ces textes sont-ils de v√©ritables sources ou des repr√©sentations occidentales ?', NULL, 1),
(67, 11, 91, NULL, 'literal', '', 'Le contre r√©cit permet de discuter la source et de la qualifier.', NULL, 1),
(68, 11, 91, NULL, 'literal', '', 'Volont√© de multiplier les interlocuteurs aux profils diff√©rents pour balayer un large spectre de r√©ponses.', NULL, 1),
(69, 11, 91, NULL, 'literal', '', 'Choix de la m√©thode :', NULL, 1),
(70, 11, 91, NULL, 'literal', '', '- triptyque de textes suivant une chronologie et qui v√©hicule une id√©ologie (projet√©s avant). Chercher √† faire r√©agir dessus. ', NULL, 1),
(71, 11, 91, NULL, 'literal', '', '- R√©cit de vie et lien avec un objet : parler d‚Äôun objet et de sa symbolique. Id√©e de poser ces 3 questions, mais peur d‚Äô√™tre trop long.', NULL, 1),
(72, 11, 91, NULL, 'literal', '', 'Lors de notre enqu√™te de terrain, nous souhaitions proposer √† nos enqu√™t√©s de lire, sur support √©lectronique, une tablette, une s√©quence de trois extraits, dans l‚Äôordre chronologique et de r√©agir √† la lecture de chacun d‚Äôentre eux et recueillons leurs r√©actions spontan√©es.', NULL, 1),
(73, 11, 91, NULL, 'literal', '', 'Diapo : 3 extraits et auteurs.', NULL, 1),
(74, 11, 91, NULL, 'literal', '', 'L‚Äôautre temps de cette enqu√™te est celui des r√©cits de vie. Il s‚Äôagit d‚Äôun temps du discours long pendant lequel l‚Äôenqu√™teur s‚Äôefface pour laisser la place au r√©cit de l‚ÄôAutre et le recueillir. Nous\r\ndemandons aux personnes interrog√©es de nous pr√©senter un objet dont la symbolique leur semble importante et de nous en parler.', NULL, 1),
(75, 11, 91, NULL, 'literal', '', 'Organisation des rendez-vous : en avance rep√©rage de personnes √† enqu√™ter.', NULL, 1),
(76, 11, 91, NULL, 'literal', '', '3) Temps de l‚Äôenqu√™te et premiers enseignements √† en tirer :', NULL, 1),
(77, 11, 91, NULL, 'literal', '', '√âquipe d‚Äôenqu√™te : Ana√Øs, Marwan et moi -> travail r√©alis√© en √©quipe sur le terrain, le recueil de mat√©riau et des r√©cits s‚Äôest fait en √©quipe. Une fois sur place temps courts avec d√©placements.', NULL, 1),
(78, 11, 91, NULL, 'literal', '', 'Expliquer qui on a rencontr√© : √† chacun sa question et son illustration.', NULL, 1),
(79, 11, 91, NULL, 'literal', '', 'a) A ouidah, rencontre avec le conservateur du mus√©e (Bertin Calixte Biah ?). Pr√©sentation du 1er texte pour le faire r√©agir : il consid√®re que ce texte s‚Äôapplique √† l‚Äôensemble du peuple b√©ninois, on se doit d\'accueillir l‚Äôautre, et surtout dans de bonnes conditions. Le rapproche du fait de se rendre disponible pour nous. R√©ponse + portrait en diapo', NULL, 1),
(80, 11, 91, NULL, 'literal', '', 'M√™me question pos√©e √† Camille Capo Chichi, dignitaire √† Ouidah, r√©agit √©galement un premier texte. \r\nR√©ponse + portrait en diapo', NULL, 1),
(81, 11, 91, NULL, 'literal', '', 'Se pose alors le probl√®me de la longueur de notre √©change, il n‚Äôest pas possible de faire r√©agir sur 3 textes. Nous prenons alors la d√©cision de n‚Äôen pr√©senter qu‚Äôun. Des difficult√©s de lecture se pr√©sentent √©galement. Nous constations un d√©calage avec l‚Äô√©crit et pour ne pas perdre le contact avec les personnes qu‚Äôon rencontre, d√©cision de basculer sur la question de l‚Äôobjet.', NULL, 1),
(82, 11, 91, NULL, 'literal', '', '- Questionnement sur l‚Äôobjet tr√®s pertinent, donc adapt√© √† l‚Äôinterlocuteur. Recentrement sur l‚Äôobjet et sur la culture orale avec un r√©cit.', NULL, 1),
(83, 11, 91, NULL, 'literal', '', 'Rencontre au sein Maison de la famille Dossou Gbete, avec le Baba Lao, f√©ticheur pratiquant le f√¢, son titre signifie anc√™tre qui d√©tient le savoir. ', NULL, 1),
(84, 11, 91, NULL, 'literal', '', 'Le f√©ticheur parle en langue vernaculaire et est traduit par Gilbert Capo Chichi. A la question de l‚Äôobjet, il nous d√©signe un f√©tiche et nous en explique la signification. Diapo : portrait et f√©tiche + transcription de la symbolique', NULL, 1),
(85, 11, 91, NULL, 'literal', '', 'Question sur l‚Äôobjet √©galement pos√©e au CPA, Bertrand, sculpteur, sculpte sur commande mais √† la question de la symbolique nous montre ce qu‚Äôil consid√®re √™tre son art : repr√©sentations des rois -> savoir-faire et savoirs historiques. (question de la commande qui perturbe la transmission des savoirs par son art)\r\nDiapo : portrait et sculpture + transcription de la symbolique', NULL, 1),
(86, 11, 91, NULL, 'literal', '', 'Yemandj√© : r√©cit de vie, transmission de son art par famille, lign√©e mais aujourd‚Äôhui volont√© de le transmettre aux autres afin que la tradition ne se perde pas, parle aussi du devoir de toujours accueillir l‚Äô√©tranger. \r\nDiapo : portrait avec tenture en arri√®re plan', NULL, 1),
(87, 11, 91, NULL, 'literal', '', 'Conclusion :', NULL, 1),
(88, 11, 91, NULL, 'literal', '', 'Lire ensemble oui, mais en fonction des interlocuteurs pas forc√©ment des textes. Mais tr√®s ouverts aux symboles. Difficult√©s terrain / point positifs non anticip√©s ( + : facilit√© devant la cam√©ra et photos, - : probl√®me de l‚Äô√©crit) .', NULL, 1),
(89, 11, 91, NULL, 'literal', '', 'Peur de questionner sur les croyances infond√©e, parlent bcp de leurs croyances, nous les expliquent sans mal et volont√© de partager. Bcp d‚Äôexplications sur le F√¢, volont√© de partage de cette culture (consid√©r√© comme croyance par nous, mais est une science ici). Dimension interculturelle tr√®s pr√©sente pendant notre semaine de terrain. Pas v√©cu comme intrusif.', NULL, 1),
(90, 11, 91, NULL, 'literal', '', 'Par contre esclavage, question peu abord√©e et difficile √† poser sans blocages.', NULL, 1),
(91, 11, 91, NULL, 'literal', '', 'Enseignements de cette confrontation avec le terrain : m√®ne √† des par ex faire √©couter les textes, question des explorateurs un peu √©loign√©e d‚Äôune r√©alit√© sociale, peut √™tre √† contextualiser avec le voyage. Peur de parler des cultes alors que les b√©ninois en parlent avec bcp de facilit√©s et aiment partager leur culture.', NULL, 1),
(92, 11, 91, NULL, 'literal', '', 'Bcp de richesse dans les √©changes, de discours sur des th√®mes qui nous semblaient bloquant et de richesses dans les rencontres.', NULL, 1),
(93, 11, 91, NULL, 'literal', '', 'Cette semaine pass√©e ensemble √† recueillir les contre r√©cits ont permis √† Marwan et Ana√Øs de cr√©er -> dimension artistique de l‚Äôinterculturalit√©. ', NULL, 1),
