(453, 12, 91, NULL, 'literal', '', 'Une fois cette premi√®re r√©action recueillie, nous pr√©senterons les interfaces par l‚Äôinterm√©diaire de vid√©os sur tablettes ou t√©l√©phones, en expliquant leur utilit√©. Ne pouvant pas faire manipuler ces interfaces aux enqu√™t√©s, cette partie de l‚Äôenqu√™te peut demander plus de temps d‚Äôexplication sur la mani√®re dont elles pourraient √™tre utilis√©es. Il s‚Äôagit maintenant de r√©fl√©chir √† la mani√®re de pr√©senter sur place le concept d‚Äôinterface qui peut √™tre tr√®s abstrait pour qui n‚Äôest pas initi√©. Comment l‚Äôexpliquer de mani√®re simple et concise ?', NULL, 1),
(454, 12, 91, NULL, 'literal', '', 'Le troisi√®me temps de cette enqu√™te est celui des r√©cits de vie. Nous demanderons aux personnes interrog√©es de nous raconter ce √† quoi elles pensent lorsque nous pr√©sentons notre sujet. L‚Äôenqu√™teur s‚Äôefface alors compl√®tement pour laisser la personne libre de son r√©cit.', NULL, 1),
(455, 12, 91, NULL, 'literal', '', '2) Moyens :', NULL, 1),
(456, 12, 91, NULL, 'literal', '', 'Les textes et les interfaces seront pr√©sent√©s sur support √©lectronique (t√©l√©phone ou tablette). Il faudra donc veiller √† avoir du mat√©riel toujours charg√©, et des batteries externes. Les √©changes seront enregistr√©s (et/ou film√©s) pour ensuite pouvoir les transcrire.', NULL, 1),
(457, 12, 91, NULL, 'literal', '', 'Deux √©tudiants b√©ninois de l‚Äôinstitut Cerco nous accompagneront en tant que facilitateurs; ils pourront aider √† nous introduire aupr√®s de certains publics et permettre le premier contact. \r\nD‚Äôautre part, afin de pallier notre manque de connaissances des langues vernaculaires, nous serons √©galement accompagn√©s d‚Äôun traducteur.', NULL, 1),
(458, 12, 2, NULL, 'literal', '', 'Katia Guibert', NULL, 1),
(459, 12, 4, NULL, 'literal', '', 'Protocole de l\'enqu√™t de terrain effectu√©e au B√©nin dans le cadre du projet ¬´ Lire ensemble ¬ª.', NULL, 1),
