(467, 41, 4, NULL, 'literal', '', 'Alvise de CA DA MOSTO (1432-1488). Commer√ßant et navigateur v√©nitien. Il part en 1455 pour le compte d\'Henri le Navigateur (fr√®re du roi du Portugal, m√©c√©ne d\'exp√©ditions) pour deux √©xp√©ditions maritimes sur les c√¥tes africaines encore m√©connues. Ses deux √©xp√©ditions le m√®nent sur les c√¥tes du S√©n√©gal et de la Gambie, d√©couvrant au passage certaines iles du Cap Vert.', NULL, 1),
(468, 41, 4, NULL, 'literal', '', 'Texte le plus ancien de notre corpus qui apporte donc le point de vue le plus neutre. L\'auteur d√©couvre l\'Afrique sans pr√©jug√©s aucuns. D√©couvre l\'alt√©rit√© africaine. Dans cet extrait il compare leur foi √† celle des berb√®res. Il parle donc de leur foi \"Mahom√©tane\" commune, mais pratiqu√©e \"plus froidement\" par les \"noirs\" √† cause de l\'influence chr√©tienne.', NULL, 1),
(469, 41, 4, NULL, 'literal', '', 'Ca da Mosto d√©crit l\'accueil r√©serv√© par les populations locales aux explorateurs europ√©ens.', NULL, 1),
(470, 41, 4, NULL, 'literal', '', 'On observe dans cet extrait les rituels d\'accueil des marchands √©trangers par ce souverain africain : √©change et achat de marchandises, cadeau (une esclave). L\'auteur se montre curieux de \"voir et entendre quelques nouveaut√©s\". Il y demeure 28 jours.', NULL, 1),
(471, 41, 4, NULL, 'literal', '', 'L\'auteur observe les coutumes et croyances avec une grande neutralit√©, et pr√©cise m√™me √† \"selon mon jugement\" lorsqu\'il √©met un avis.\r\npp98-100: l\'auteur d√©crit le culte musulman et la mani√®res dont les azen√®gues pr√©sents instruisent le roi sur celui-ci. C\'est √† la demande du roi que Ca Da Mosto √©nonce des pri√®res chr√©tiennes et d√©crit sa foi. La discussion entre l\'auteur et le roi Budomel sur la foi montre l\'ouverture de chacun et la curiosit√© de d√©couvrir l\'autre.', NULL, 1),
(472, 41, 36, NULL, 'uri', NULL, 'Gallica', 'https://gallica.bnf.fr/ark:/12148/bpt6k1048998/f97.image.r=voyages%20en%20afrique%20noire%20alvise', 1),
(473, 41, 8, NULL, 'literal', '', 'Image', NULL, 1),
(474, 41, 57, NULL, 'literal', '', 'Apr√®s avoir cotoy√© les berb√®res azen√®gues, l\'auteur emprunte le fleuve S√©n√©gal pour se retrouver en Guin√©e. Il y observe le mode de vie des autochtones.', NULL, 1),
(475, 41, 57, NULL, 'literal', '', 'L\'auteur en remontant le fleuve S√©n√©gal arrive au royaume de Cayor ou Kadior, dont le souverain porte le titre de Budomel (en wolof). Il s\'agit l√† de sa premi√®re rencontre avec le roi Budomel.', NULL, 1),
(476, 41, 57, NULL, 'literal', '', 'Ca da Mosto est toujours avec le roi Budomel et observe les coutumes selon lesquelles les sujets se pr√©sentent au roi. Il est √©galement invit√© √† entrer dans la mosqu√©e pour la pri√®re. S\'en suit alors un d√©bat sur la foi de chacun.', NULL, 1),
