(487, 26, 4, NULL, 'literal', '', 'L√©on l\'Africain, de son vrai nom Hassan Ibn Mohammed et-Ouazzan, n√© entre 1486 et 1488 √† Grenade. Sa famille s\'exile √† F√®s, au Maroc lors de la Reconquista, o√π il suit une formation de lettr√©. Il devient ensuite diplomate et parcourt l\'Afrique et le Moyen Orient. Lors de l\'un de ses voyages il est captur√© √† Djerba et offert au pape L√©on X. Il re√ßoit une instruction catholique et se fait baptiser en 1520. Le pape lui donne comme nom chr√©tien son propre nom, L√©on de M√©dicis. A la demande du pape il r√©dige sa description de l\'Afrique', NULL, 1),
(488, 26, 4, NULL, 'literal', '', 'Les extraits choisis son tir√©s du livre septi√®me ¬´ O√π il est trait√© du pays des noirs ¬ª. L√©on l\'Africain y d√©crit un √† un les royaumes qu\'il a parcouru. Grande neutralit√© √©galement chez L√©on l\'Africain.\r\nMelli, royaume\r\nll s\'agit d\'une description du royaume du Mali (Melli dans le texte).', NULL, 1),
(489, 26, 4, NULL, 'literal', '', 'Gago et le royaume d\'icelle. Il s\'agit du royaume de Gaoga, une petite entit√© politique que l\'on situe difficilement.', NULL, 1),
(490, 26, 4, NULL, 'literal', '', 'Agadez et son royaume. Ville du Niger.', NULL, 1),
(491, 26, 91, NULL, 'literal', '', 'P.291 : ¬´ Ils ont des pr√™tres et lecteurs, qui lisent dans leurs temples, et pour ce qu\'il n\'y a point de col√®ges et sont ceux-cy les plus civils, de meilleur esprit et plus grande reputation de tous les Noirs, pour autant qu\'ils furent les premiers √† recevoir la loy de Mahommet et de ce temps l√†, furent subjugu√©s par un grand prince entre les peuples de Libye, qui √©toyt oncle de Joseph, roy de Maroc, duquel la seigneurie demeura √† ses successeurs jusques au temps d\'Izchia [...] ¬ª', NULL, 1),
(492, 26, 91, NULL, 'literal', '', 'P.293 : ¬´ Les marchans de Barbarie transportent plusieurs draps d\'Europe en cette cit√©. Les femmes vont ordinairement le visage couvert, fors les esclaves qui vendent toutes les choses de bouche. ¬ª', NULL, 1),
(493, 26, 91, NULL, 'literal', '', 'P.299 : ¬´ Il y a plusieurs pluy d\'eau douce, avec une grande place, en laquelle, au jour du march√©, se vendent les esclaves tant hommes que femmes ; et s\'ach√®te une fille de quinze ans au prix de six ducats, et autant un gar√ßon.\r\nLe toy tient en un palais √©cart√© une infinit√© de concubines, esclaves et eunuques. ¬ª', NULL, 1),
(494, 26, 91, NULL, 'literal', '', 'PP.302-303 : ¬´ Les maisons sont fort bien b√¢ties et en la mani√®re de celles de Barbarie, pour ce qu\'il ne s\'y trouve gu√®re de marchans autres qu\'etrangers ; et ce peu qu\'on y void du pa√Øs sont tous artisans, ou √† la soulde du roy de cette cit√©, en laquelle n\'y a marchant, qui ne tienne un grand nombre d\'esclaves pour s\'en aider √† ses affaires [...]. ¬ª', NULL, 1),
(495, 26, 57, NULL, 'literal', '', 'L\'auteur parle du royaume du Mali comme du premier royaume Noir √† √™tre devenu musulman, et consid√®re de ce fait ses habitants comme les plus √©duqu√©s.', NULL, 1),
(496, 26, 57, NULL, 'literal', '', 'Au royaume du Mali l\'auteur mentionne l\'esclavage uniquement en d√©crivant l\'importance des marchands √† Tombut (Tombouctou). Ici, il s\'agit des esclaves de marchands venus de Barbarie (Maghreb actuel).', NULL, 1),
(497, 26, 57, NULL, 'literal', '', 'L\'esclavage semble tenir une place plus importante au royaume Gago. On apprend que les esclaves y sont vendus, mais √©galement que le roi en d√©tient un grand nombre au sein de son palais.', NULL, 1),
(498, 26, 57, NULL, 'literal', '', 'Comme au royaume Melli, les esclaves mentionn√©s dans cet extrait sont les esclaves de marchands venant de Barbarie.', NULL, 1),
