(501, 109, 4, NULL, 'literal', '', 'Olfert Drapper (1635-1689), humaniste n√©erlandais. Il entreprend des recherches g√©ographiques et publie en 1668 sa description de l\'Afrique. N\'ayant jamais quitter les Pays-Bas, il s\'agit d\'un ouvrage de synth√®se d\'ouvrages d\'histoire, de g√©ographie et de r√©cits de voyages consult√©s.', NULL, 1),
