(513, 110, 4, NULL, 'literal', '', 'Fran√ßois FROGER, n√© en 1676, explorateur fran√ßais. Il part en exp√©dition en 1695 sur le navire de Jean-Baptiste de Gennes et relate son voyage dans son ouvrage. Il y relate ce qui lui semble int√©ressant pour le lecteur et enrichit son ouvrage de cartes.', NULL, 1),
(514, 110, 4, NULL, 'literal', '', 'L\'auteur relate l\'arriv√©e de son bateau sur l\'√Æle de Gor√©e (au large de Dakar) et d√©crit ce qu\'il y observe comme mode de vie.', NULL, 1),
(515, 110, 4, NULL, 'literal', '', 'L\'√©quipage quitte Gor√©e et remonte le fleuve Gambie. De Gennes prend aux anglais le fort Saint-James, renomm√© par les fran√ßais fort Saint-Jacques et n√©gocie cette prise avec le roi Bar.\r\nIls quittent l\'Afrique apr√®s la prise ce fort pour se rendre au Br√©sil et tenter de passer le d√©troit de Magellan.', NULL, 1),
(516, 110, 91, NULL, 'literal', '', 'PP.5-7 ¬´ Le gouverneur de cette ille envoya aussit√¥t complimenter monsieur de Gennes [...] que nous avions d\'aller √† Gambie ¬ª', NULL, 1),
(517, 110, 91, NULL, 'literal', '', 'PP.17-18 : ¬´ Les Marabous sont en grand nombre ; ils ont chacun plusieurs femmes ; ils prient Dieu cinqfois le jour : mais seulement √† minuit, au lever et au coucher du Soleil, et avant les pri√®res ils se lavent plusieurs fois tout le coprs ; ils √©crivent et parlent l\'Arabe, comme nous faisons le Latin ¬ª', NULL, 1),
(518, 110, 91, NULL, 'literal', '', 'PP.18-20 : ¬´ La plupart des N√®gres sont sans Religion et vivent dans les bois du butin qu\'ils font sur les passants. Ceux qui ont quelque croyance suivent une secte de Mahomet fort corrompue ; ils portent au col, aux bras, aux jambes et m√™me lient √† leurs cheveux des petits sachets de cuirs qu\'ils appellent Grisgris, o√π ils enferment des passages d\'Alcoran, que les Marabous leur donnent pour les garentir des b√™tes venimeuses et de toute sorte de blessure (superstition abominable qu\'ils observent √©galement sur les chevaux qu\'ils mennent √† la guerre). Ils circoncisent leurs enfants : mais ce n\'est qu\'√† l\'√¢ge de 12 ou 13 ans. Le jour de Sabbath est le lundi ; ils ne travaillent point et ne font aucun repas ce jour-l√†. Ils n\'ont aucune f√™te consid√©rable que le Tabask√© qui arrive au mois de juin [...]Voil√† tout ce que j\'ai v√ª et pu apprendre de cette C√¥te qui l\'ait paru vraisemblable. ¬ª', NULL, 1),
(519, 110, 91, NULL, 'literal', '', 'PP 16-17 : ¬´ En descendant cette riviere nous mimes √† terre au bourg de Barifet, o√π il y a un petit roy, tributaire de celui de Block. Ce roy nous envoya dire que c\'√©tait la coutume des Etranger de lui faire quelque pr√©sent et qu\'il nous priair de lui envoyer un manteau d\'√©carlate ; nous le contentames avec quelques bouteilles d\'Eau de vie, qu\'il re√ßut plus agr√©ablement qu\'il n\'aurait fait le plus beau manteau du monde. ¬ª', NULL, 1),
(520, 110, 91, NULL, 'literal', '', 'PP 34-36 : ¬´ Le lendemain monsieur de Gennes fut rendre visite au roi, les principaux officiers vinrent au devant de lui jusqu\'√† son canot et le men√®rent au lieu ou se devoit faire l\'entrevue.\r\nLe roi parut aussit√¥t sans ordre au milieu d\'un grand nombre de N√®gre et de quelques Tambours ; il √©tait d\'une taille assez avantageuse et v√©tu d\'un petit poupoint rouge, couvert de queues de B√™tes sauvages et de Grelots, il avait sur la t√™te un bonnet d\'Ozier orn√© de plusieurs rangs de corail et de deux cornes de b≈ìuf [...]. Le roi en ce pompeux √©quipage et la pipe √† la bouche s\'avan√ßa sous un gros arbre, o√π il donna audience aux ambassadeurs des rois ses voisins. Monsieur de Genne l\'y alla saluer et lui fit pr√©sent de vingt barre de Fer, d\'un baril d\'eau de vie, d\'une paire de pistolets et d\'un mliroir ardent dont l\'√©preuve le surpris beaucoup. Comme l\'interpr√®te qui √©tait un fran√ßois √©tablit sur la rivi√®re depuis plus de dix ans avait beaucoup de facilit√© √† parler la langue du pays, ils eurent une longue conversation et entr\'autres choses, ce pauvre roi demanda plusieurs fois si on parlait beaucoup de lui en France. Apr√®s plusieurs discours semblables il se quitt√®rent, le roi fit reconduire Monsieur de Gennes par quarante de ses gardes et quelques tambours et lui fit pr√©sent des plus beaux b≈ìufs qui se purent trouver dans le bourg ¬ª', NULL, 1),
(521, 110, 91, NULL, 'literal', '', 'PP46-47 : ¬´ Les portugais nous ont dit que les N√®gres qui sont avanc√©s dans les terres et avec qui ils ont peu de commerce sont tout √† fait sauvages, se vantent d\'√™tres de grands sorcier, ont peu de religion ; que lorsqu\'il meurt un roi, ou quelqu\'un des principaux, ils le mettent dans une caze neuve, tuent sa femme favorite, et un certain nombre d\'esclaves pour le servir dans l\'autre monde et qu\'enfin apr√®s avoir fait quelques pri√®res et avoir mis dans cette caze des vivres et du tabac pour un temps assez confortable, ils la couvrent de terre. ¬ª', NULL, 1),
(522, 110, 57, NULL, 'literal', '', 'Froger d√©crit les √©changes entre son √©quipage et la population de Gor√©e. Il s\'agit de troc ¬´ Les n√®gres venaient continuellement √† bord avec leurs pirogues charg√©es de poissons qu\'ils nous donnaient pour des couteaux, quelques feuilles de papier [...] ¬ª', NULL, 1),
(523, 110, 57, NULL, 'literal', '', 'Froger fait √©galement r√©f√©rence √† l\'Islam et √† la mani√®re dont cette religion est pratiqu√©e. Il d√©crit ici le rituel de pri√®re.', NULL, 1),
(524, 110, 57, NULL, 'literal', '', 'L\'auteur parle de ¬´ secte de Mahomet fort corrompue ¬ª car les rites diff√®rent de ceux de l\'Islam, notamment par l\'usage de grisgris, o√π dans le d√©roulement du sacrifice de Tabask√©.', NULL, 1),
(525, 110, 57, NULL, 'literal', '', 'Froger d√©crit l\'accueil de son √©quipage par le roi de Block qui r√©clame des pr√©sents. Il est int√©ressant de noter que le pr√©sent offert ici est de l\'eau de vie.', NULL, 1),
(526, 110, 57, NULL, 'literal', '', 'Froger d√©crit la n√©gociation entre le roi et de Gennes pour la possession du fort Saint-Jacques : √©change de pr√©sents et discussion. Cet extrait nous apprend la pr√©sence d\'un interpr√®te qui vivrait dans la r√©gion depuis plus de dix ans.', NULL, 1),
(527, 110, 57, NULL, 'literal', '', 'L\'auteur relate ici des propos rapport√©s par des portugais rencontr√©s sur place. Il ne s\'agit donc pas de sa propre observation. Il parle de rites mortuaires avec sacrifices humains, √† la fois d\'esclaves et de l\'√©pouse du roi d√©funt.', NULL, 1),
