(537, 111, 4, NULL, 'literal', '', 'L\'ouvrage est divis√© en plusieurs lettres, traitant chacune de sujets diff√©rents. La neuvi√®me lettre traite entre autres de ¬´ la civilit√© qu\'ils font √† ceux qui viennent les voir ¬ª.', NULL, 1),
