(541, 111, 4, NULL, 'literal', '', 'Willem Bosman, (1672-?). Marchand au service de la compagnie des indes n√©erlandaise. Il passe la majorit√© de sa vie en Gold Coast n√©erlandaise, et rentrer aux Pays-Bas en 1702. La description qu\'il fait de la Guin√©e est une r√©f√©rence car il y d√©crit avec pr√©cision le commerce d\'esclaves.', NULL, 1),
(542, 111, 91, NULL, 'literal', '', 'PP. 132-133', NULL, 1),
