(544, 111, 91, NULL, 'literal', '', 'P.344 : ¬´ Outre cela, ces peulples trafiquent en esclaves, que ces Negres ach√®tent aussi d\'eux ; mais la plupart des esclaves sont transportez par les vaisseaux Anglois, Francois, & Portugais. Le trafic des esclaves est quelquesfois fort avantageux ici & surtout aux environs du village de Lay.\r\nIl arrive bien aussi, que lorsque les guerres cessent plus avant dans le paus, on ne trouve plus ici d\'esclaves : de sorte que le negoce y est fort incertain, & ce n\'est qu\'en passant qu\'on s\'y arr√™te ; mais il n\'y faut pas faire beaucoup de fonds ¬ª', NULL, 1),
(545, 111, 91, NULL, 'literal', '', 'P.351 : ¬´ Ceux de Popo vivent de la m√™me mani√®re que ceux de Coto, c\'est √† dire, du butin qu\'ils font des esclaves qu\'ils vendent. Mais ils surpassent pourtant beaucoup les premiers, car √©tans plus hardis, ils font aussi plus de butin, & par consequent leur negoce est plus considerable, cependant il faudroit quelques mois pour charger ici un vaisseau d\'esclaves.\r\nL\'an 1697, je ne pus acheter que trois esclaves en trois jours que j\'y demeurai ; mais ils m\'assurerent que si je voulois attendre encore trois jours, ils m\'en pourroient fournir pr√®s de deux cens : j\'√©coutai leur proposition, mais √©tant all√© √† bord sous pretexte de chercher des marchandises qu\'ils demandoient, je fis lever l\'ancre et mettre les voiles pour aller √† Fida, & quand je fus arriv√©, j\'appris que leur course avoit si bien reussi qu\'ils avoient prus plus de deux cens esclaves, & que faute d\'autres marchands, ils furent obligez de les vendre aux portugais. ¬ª', NULL, 1),
(546, 111, 91, NULL, 'literal', '', 'P.358 : ¬´ Je ne saurois m\'empecher de rendre t√©moignage √† leur civilit√©. Ils nous traitent tous, depuis le plus grand jusqu\'au moindre, de la mani√®re du monde la plus honn√™te & la plus respectueuse. Les autres N√®gres nous importunent sans cesse pour avoir des pr√©sens, mais ceux-ci ne nous demandent jamais rien qu\'un peu de brandevin, & ils aimeroient mieux nous faire des pr√©sens, que d\'en recevoir de nous, si ce n\'est quand quand nous avons trafiqu√© avec eux, ils aiment bien que nous reconnoissions les services qu\'ils nous ont rendus ; mais outre cela, ils sont inviolablement attach√©s √† leurs anciennes coutumes, √† quoi personne ne peut raisonnablement rien trouver √† redire. ¬ª', NULL, 1),
(547, 111, 91, NULL, 'literal', '', 'P.362 : ¬´ Les maris sont si jaloux de leurs femmes, que sur le moindre soup√ßon ils les vendent aux Europ√©ens pour les transporter ailleurs, & ils ne font pas comme les N√®gre de la C√¥te de Guin√©e qui n√©gocient avec leurs femmes ; mais il n\'en va pas de m√™me ici. Si quelqu\'un couche avec la femme d\'un autre, il se doit presque assurer de mourir, en cas que la partie offens√©e ait du bien, & il arrive m√™me souvent, que pour son crime toute la famille est r√©duite √† l\'esclavage. ¬ª', NULL, 1),
(548, 111, 91, NULL, 'literal', '', 'P.381 : ¬´ Il a trois receveurs pour le negoce des esclaves ; car chaque esclave qu\'on √©change ou qu\'on vend doit un √©cu au Roi ; mais ceux-ci font comme les autres, & s\'accordent avec ceux qui nous vendent les esclaves de sous main ; et de sorte que le Roi n\'en a rien. Il est vrai qu\'il a plus de pr√©caution √† l\'√©gard des esclaves qu\'on paye en bousies, (c\'est l\'argent de ce pays ci) retirant de chaque esclave trois √©cus ; car les payemens se font en sa pr√©sence & c\'est en quoi on lui fait le moins de tort ¬ª', NULL, 1),
(549, 111, 66, NULL, 'literal', '', 'A. Schouten (Utrecht)', NULL, 1),
