(551, 112, 1, NULL, 'literal', '', '\r\n    M√©moires du r√®gne de Bossa-Ahad√©e, roi de Dahom√©, √©tat situ√© dans l\'int√©rieur de la Guin√©e, et voyage de l\'auteur √† Abom√©, qui en est la capitale. On y a ajout√© des Observations sur la traite des n√®gres...', NULL, 1),
