(558, 112, 4, NULL, 'literal', '', 'Norris, Robert (1724?-1791). Historien, voyageur, auteur d\'√©tudes sur l\'esclavage. L\'auteur est pr√©sent√© d√®s l\'avant propos comme contre l\'abolition. Le traducteur nous met en garde : \"L\'auteur de ces m√©moires est contre l\'abolition, par cons√©quent il n\'a pas flatt√© le tableau de l\'Afrique et de ses habitants.\"', NULL, 1),
(559, 112, 4, NULL, 'literal', '', 'L\'auteur arrive au Dahomey dans le but d\'acheter des esclaves. Il cherche √† rencontrer le roi.', NULL, 1),
(560, 112, 4, NULL, 'literal', '', 'L\'auteur est en route pour Abomey et en chemin s\'arr√™te √† Calmina.', NULL, 1),
(561, 112, 4, NULL, 'literal', '', 'Arriv√©e √† Abomey.', NULL, 1),
(562, 112, 4, NULL, 'literal', '', 'L\'auteur est introduit au roi d\'Abomey au sein de son palais.', NULL, 1),
(563, 112, 91, NULL, 'literal', '', 'P. 74: \"Mes affaires exigeant que j\'eusse une entrevue avec le roi, je m\'adressai au vice-roi pour avoir le nombre d\'hommes n√©cessairesw pour m\'accompagner. Il me donna en effet un interpr√®te, dix hommes pour les hamacs, dix porteurs et un chef pour commander cette troupe : ce chef √©tait responsable de la conduite des autres: mes propres domestiques, et quelques autres qui accompagnaient le capitaine et qui √©taient arm√©s, formaient une caravane de trente personnes.\"', NULL, 1),
(564, 112, 91, NULL, 'literal', '', 'p.95: \"Je fus introduit √† Calmina dans les appartements de la maison du Maybou et j\'y re√ßus un messager de sa part, avec des compliments de felicitation sur mon heureuse arriv√©e; il d√©sira savoir dans quel temps je me proposais de faire mon entr√©e √† Abom√© et si je voudrais consentir √† √™tre re√ßu en c√©r√©monie par les grands officiers de la cour. L\'√©tiquette, en ces cas-l√† consiste en ce que le premier ministes et autres personnes de haute distiction vont avec un cort√®ge nombreux et sous les armes, au devant de la personne qu\'on re√ßoit. Cette troupe √©x√©cute diff√©rents exercices militaires, et fait quelques d√©charges de mousqueterie, apr√®s quoi les chefs descendent et re√ßoivent l\'√©tranger sous l\'ombrage de grands parasols; il lui p√©sentent d\'abord un gobelet d\'eau fra√Æche, et ensuite un petit verre d\'eau de vie qui est bu √† la sant√© du roi: alors ils marchent √† pied et accompagnent jusqu\'√† la ville celui auquel ils rendent ces honneurs.\"', NULL, 1),
(565, 112, 91, NULL, 'literal', '', 'P.97: \" A mon arriv√©e √† la porte d\'Abom√©, je fus salu√© de quinze coups de canon, et conduit dans les appartements des blancs, dans la maison du Maybou: son intendant m\'attendait avec un pr√©sent de la part de son ma√Ætre et qui consistait en un peu d\'eau fra√Æche, un pot de pitto et quelques volailles. Le Maybou parut bientot accompagn√© par Eubiga, le vice-roi de Juda, et vint me f√©liciter, de la part de son maitre, de mon heureuse arriv√©e, et de ce que j\'avais fait ma route sans accident, ou sans en avoir √©t√© incommod√©. Ce compliment fut suivi d\'un pr√©sent de la part du roi, √† savoir d\'un mouton, de quelques volailles, de deux jarres de pitto, de deux corbeilles cde farine de froment, d\'une callebasse d\'huile de palme, d\'une de sel et d\'une bouteille d\'eau de vie.\"', NULL, 1),
(566, 112, 91, NULL, 'literal', '', 'p.107: \"Le 5 f√©vrier √† dix heures, accompagn√© de mon interpr√®te je fus re√ßu √† la porte par le Maybou, il y avait de chaque c√¥t√© du seuil une t√™te d\'homme r√©cemment coup√©e, [...], il y avait dans le corp de garde environ 40 femmes, arm√©es chacune d\'un mousquet et d\'un sabre, et 20 eunnuques. L\'un d\'eux se d√©tacha pour aller annoncer mon arriv√©e. [...] Apr√®s avoir salu√© le roi, on me conduisit √† un fauteil √†√† quelques pas de lui et apr√®s avoir bu un petit verre d\'eau de vie √† sa sant√© et lui un autre √† la mienne, il s\'informa de celle de son fr√®re George, roi d\'Angleterre et me fit quelques questions concernant mon voyage. Nous convers√¢mes ensemble par le moyen de mon domestique qui servait d\'interpr√®te et du Maybou qui d\'abord baisait la terre avant d\'oser r√©p√©ter √† mon domestiques les paroles du roi, coutume qui s\'observe toujours dans tous les lieux du royaumme, de m√™me qu\'en la pr√©sence de sa majest√©, toute les fois qu\'une personne a une occasion de r√©p√©ter ce que le roi a dit ou de d√©livrer quelque ou quelque message de sa part.\"', NULL, 1),
(567, 112, 57, NULL, 'literal', '', 'L\'auteur d√©crit les moyens mis √† sa disposition par le roi d\'Abomey pour venir √† sa rencontre', NULL, 1),
(568, 112, 57, NULL, 'literal', '', 'Il d√©crit l\'ensemble du c√©r√©monial d\'introduction d\'un √©tranger √† la cour du roi d\'Abomey, notamment avec la description des pr√©sents qui lui sont faits.\r\nLe Maybou est un conseiller du roi, il a avec le Tam√©ga (vice-roi) le pouvoir de d√©signer le succ√©sseur du roi parmi ses fils √† sa mort. Il est √©galement maitre de c√©r√©monie et dirige toutes les c√©l√©brations publiques de la cour.', NULL, 1),
(569, 112, 57, NULL, 'literal', '', 'L\'auteur fait mention dans cet extrait de la f√™te des coutumes mais √©galement de la pr√©sence des amazones √† la cour du roi. On y apprend le rituel selon lequel la parole du roi ne peut √™tre r√©p√©t√© sans accomplir certains gestes.', NULL, 1),
