(578, 113, 4, NULL, 'literal', '', 'Mungo Park, M√©decin, explorateur. - √âtudie la m√©decine √† Edimburgh et acquiert des connaissances en botanique. Embarque comme aide-chirugien sur un vaisseau de la Compagnie des Indes qui l\'emm√®ne √† Sumatra (1792). Au retour, il r√©dige un m√©moire sur les esp√®ces de\r\nMungo Park arrive √† Joag, premi√®re ville du royaume Kajaaga ou Galam travers√©e. Il s\'agit d\'un royaume Sonink√© dans l\'actuel S√©n√©gal.\r\nP.101 : ¬´ D√®s qu\'il commen√ßa √† faire nuit, on m\'invita √† aller voir les jeux des habitants, parce que la coutume du pays est que, quand il arrive quelque √©tranger, on c√©l√®bre sa venue par des divertissements. Je vis une foule de peuple faisant un grand cercle autour de quelques danseurs. Il y avoir de grands feux allum√©s, et quatre tambours, qui battaient avec beaucoup d\'ensemble et de justesse. ¬ª\r\nMungo Park d√©crit la c√©r√©monie d\'accueil reserv√©e aux √©trangers. On voit qu\'il s\'agit de v√©ritables festivit√©s.\r\nDispositifs d\'accueil\r\npoissons qu\'il y a d√©couvertes. Apr√®s la mort de Houghton, il se met √† la dispotion de l\'African Society pour poursuivre les explorations en vue d\'atteindre le fleuve Niger. Il y parviendra lors des deux voyages qui le rendront c√©l√®bre, et trouvera la mort au cours du second. . - Premier voyage (1795-1797) : parti du comptoir britannique de Pisania, o√π il a appris les rudiments de la langue mandingue, Park traverse le Bondou, le Galam, le Kasso et le Kaarta (royaumes peuls, sarakol√© ou bambara), avant de tomber entre les mains des Maures Ouled\r\nMungo Park, M√©decin, explorateur. - √âtudie la m√©decine √† Edimburgh et acquiert des connaissances en botanique. Embarque comme aide-chirugien sur un vaisseau de la Compagnie des Indes qui l\'emm√®ne √† Sumatra (1792). Au retour, il r√©dige un m√©moire sur les esp√®ces de\r\nVoyage dans l‚Äôint√©rieur de l‚ÄôAfrique. Paris, La D√©couverte, ‚Äúcoll. Litt√©rature de Voyage‚Äù n¬∞ 14, 1996, 354 p.\r\nhttps://gallica.bnf.fr/ark: /12148/bpt6k103612z?rk=21459;2\r\npoissons qu\'il y a d√©couvertes. Apr√®s la mort de Houghton, il se met √† la dispotion de l\'African Society pour poursuivre les explorations en vue d\'atteindre le fleuve Niger. Il y parviendra lors des deux voyages qui le rendront c√©l√®bre, et trouvera la mort au cours du second. . - Premier voyage (1795-1797) : parti du comptoir britannique de Pisania, o√π il a appris les rudiments de la langue mandingue, Park traverse le Bondou, le Galam, le Kasso et le Kaarta (royaumes peuls, sarakol√© ou bambara), avant de tomber entre les mains des Maures Ouled Amar qui le retiennent prisonnier. Il parvient √† s\'√©chapper et atteint le Niger √† S√©gou, capitale d\'un royaume bambara. Il descend alors le fleuve jusqu\'√† Silla, mais ne peut poursuivre au del√† sans risquer de rencontrer √† nouveau l\'hostilit√© des Maures. Il regagne alors son point de d√©part sur la Gambie en passant par Bamako et le pays mandingue. . - Second voyage (1805) : parti de la Gambie avec une petite troupe d\'hommes arm√©s, Park avance jusqu\'√† Bamako malgr√© la saison des pluies et les fi√®vres qui d√©ciment le groupe d\'europ√©ens. A Sansanding, il construit un bateau pour descendre le Niger jusqu\'√† son embouchure. Avant de s\'embarquer, il fait parvenir ses notes en Gambie, puis ne donne plus de nouvelles. Plus tard, un guide mandingue, Isaaco, envoy√© dans l\'int√©rieur pour s\'enqu√©rir du sort de l\'exp√©dition, apprend que Park est arriv√© jusqu\'en pays haoussa avant de p√©rir aux rapides de Boussa, peut-√™tre sous les coups d\'une attaque des riverains. Il √©tait alors √† environ 400 km. de la c√¥te.', NULL, 1),
