(583, 113, 91, NULL, 'literal', '', 'P.101 : ¬´ D√®s qu\'il commen√ßa √† faire nuit, on m\'invita √† aller voir les jeux des habitants, parce que la coutume du pays est que, quand il arrive quelque √©tranger, on c√©l√®bre sa venue par des divertissements. Je vis une foule de peuple faisant un grand cercle autour de quelques danseurs. Il y avoir de grands feux allum√©s, et quatre tambours, qui battaient avec beaucoup d\'ensemble et de justesse. ¬ª', NULL, 1),
(584, 113, 91, NULL, 'literal', '', 'P.103 : ¬´ Mon h√¥te √©tait pr√©sent. Je lui observai que comme je n\'entendois pas la langue des serawoullis, j\'esp√©rois qu\'on me parleroit mandingue. On y consentit. Alors un petit homme qui avoit sur lui un nombre considerable de saphis, commen√ßa √† me faire une tr√®s-longue harangue, pour me dire que j\'√©tois entr√© dans la ville du roi sans payer les droits et sans faire aucun pr√©sent au monarque ; et que, suivant les lois du pays, mes gens, mes animaux, mes bagages devoient √™tre confisqu√©s. Il ajouta que lui et ses camarades avoient ordre de me mener √† Maana, o√π r√©sidoit le roi, et que je refusois de marcher de bonne volont√©, ils seroient oblig√©s de m\'y conduire par force. ¬ª', NULL, 1),
(585, 113, 91, NULL, 'literal', '', 'P.108 : ¬´ Vers le soir, j\'√©tois assis sur le bentang, tristement occup√© √† r√©fl√©chir, lorsqu\'une vieille femme esclave passa avec un panier sur la t√™te. Elle me demanda si j\'avois d√Æn√©. Comme je crus qu\'elle vouloit se mosquer de moi, je ne lui r√©pondis pas. Mais mon domestique, qui √©toit √† mes c√¥t√©s, parla pour moi, et lui dit que des gens envoy√©s par le roi m\'avoient d√©rob√© tout mon argent. La bonne femme paroissoit extremement touch√©e de mon d√©sastre, mit son panier √† terre, et me montrant qu\'il contenoit des pistaches, elle me demanda si je pouvois en manger. Je lui dis qu\'oui. Aussitot elle m\'en donna quelques poign√©es et s\'√©loigna avant que j\'eusse le tems de la remercier d\'un secours venu si √† propos.\r\nQuoique cet incident f√ªt de peu de cons√©quence, il me causa beaucoup de satisfaction. Je consid√©rai avec plaisir la conduite d\'une pauvre esclave priv√©e d\'instruction, laquelle, sans me connoitre, n\'avoit eu besoin pour me secourir, que de c√©der √† l\'impulsion de son c≈ìur. Elle savoit par exp√©rience que la faim √©toit une chose cruelle, et ses propres maux l\'avoient rendue sensibles √† ceux des autres. ¬ª', NULL, 1),
