(598, 114, 91, NULL, 'literal', '', 'P.93 : ¬´ La religion du n√®gre est comme sa vie, d√©cousue, insens√©e.\r\nTout ce qui frappe son esprit, son sens, est pour lui un sujet d\'adoration, si bien que son culte est d\'une vari√©t√©, d\'une √©tranget√© infinies : arbre, brin d\'herbe, l√©gume, fruit, coquillage, caillou, verroterie, serpent, lion, l√©opard, crocodile, l√©zard, √©l√©phant, astres, etc., sont ses f√©tiches, ses idoles. ¬ª', NULL, 1),
(599, 114, 57, NULL, 'literal', '', 'Tout au long de l\'ouvrage, et au sein de cet extrait, transparait un jugement de l\'auteur sur le mode de vie et les croyances du peuple du Dahomey. On voit clairement l\'√©volution de point de vue entre les r√©cits des premiers explorateurs et ceux du 19√®me si√®cle, emprunt d\'une id√©ologie ¬´ civilisatrice ¬ª. Il g√©n√©ralise une image n√©gative des populations noires.', NULL, 1),
