(613, 115, 91, NULL, 'literal', '', 'P.14 : ¬´ D√®s min arriv√©e √† la c√¥te des Esclaves, j\'√©crivais √† mon jeune fr√®re, qui faisait alors ses √©tudes : ¬´ les livres te montrent le noir toujours courb√©, sous le fouet, toujours pr√™t √† se jeter sur ses ma√Ætres, insociable, √©tranger presque √† tout sentiment humain. Ce noir, je ne le vois pas ici : c\'est le noir des colonies, arrach√© violemment √† son pays, √† ses parents, men√© comme une brute, avili sous le joug. Ici le noir est chez lui ; et, m√™me au milieu des abaissements et de la d√©gradation inh√©rents √† l\'idol√¢trerie, il conserve, empreints dans son caract√®re et dans ses habitudes, les signes non √©quivoques de la dignit√© humaine. Il vit avec ses semblables ; il a sa religion et son culte ; il a ses pr√™tres, son roi, ses chefs, etc. ¬ª\r\nLa v√©rit√© s\'imposait √† moi, lorsque je tra√ßais ces lignes : le n√®gre ne me paraissait pas vil et m√©prisable, comme le pr√©sentent les r√©cits de certains voyageurs et les syst√®mes des anthropologistes. Nous sommes h√©las ! Habitu√©s √† voir le n√®gre √† travers le prisme des pr√©jug√©s m√©prisants. On l\'a raval√© dans l\'opinion ; on a accumul√© sur son compte tant d\'id√©es fausses, absurdes, r√©voltantes, qu\'il est presque impossible de reconna√Ætre l\'homme en lui.\r\nEtudions-le de pr√®s, dans ses usages et dans ses institutions, et nous verrons combien il est injuste de l\'exclure de la grande famille humaine. ¬ª', NULL, 1),
(614, 115, 91, NULL, 'literal', '', 'P.67 : ¬´ D√®s que nous sommes arriv√©s chez le y√©vogan, un de ses serviteurs nous a accueillis √† la porte, et nous a imm√©diatement introduits dans la cour int√©rieure, o√π le chef re√ßoit les visites. L√†, il a re√ßu de nous la canne que nous tenions √† la main ; nous l\'avons charg√© d\'offrir nos hommages au cab√©c√®re, et de lui maifester notre d√©sir de le voir. ¬´ Dis lui, ai-je ajout√©, que je viens lui pr√©senter ce P√®re, arriv√© depuis peur de jours de la terre des blancs ¬ª. Le serviteur, nous ayant pr√©sent√© des chaises, a disparu dans l\'int√©rieur, emportant nos cannes. Il est revenu bient√¥t, nous a salu√©s de la part de son ma√Ætre et nous a pri√©s d\'attendre. Il ne rapportait pas nos cannes, ce qui voulait dire que nous allions √™tre admis. Le y√©vogan n\'a pas tard√© √† para√Ætre, accompagn√© de deux des siens et suivi d\'une jeune fille arm√©e d\'un √©ventail. Lui-m√™me portait nos cannes ; il nous les a rendues apr√®s nous avoir donn√© une poign√©e de main √† chacun, puis nous invitant √† nous assoir, il s\'est √©tendue sur une natte pos√©e √† terre. ¬ª', NULL, 1),
(615, 115, 91, NULL, 'literal', '', 'P.68 : ¬´ G√©n√©ralement on ne parle que par interpr√®te au y√©vogan et aux autres chefs : c\'est une rubrique du c√©r√©monial des reception dont on a de la peine √† s\'affranchir. Les chefs sont entour√©s d\'espions qui, de la sorte, entendent tout ce qu\'on dit. De plus, l\'interpr√®te adoucit dans sa traduction les mots durs ou blessants de l\'interlocuteur √©tranger. Les indig√®nes seuls parlent directement aux chefs en langue du pays. Si un blanc converse avec eux autrement que par interpr√®te, ce n\'est jamais que dans l\'intimit√© et en l\'absence d\'espions. ¬ª', NULL, 1),
(616, 115, 91, NULL, 'literal', '', 'P.69 : ¬´ L\'usage du pays veut que l\'on ne re√ßoive pas un ami sans lui offrir √† boire : l\'√©tiquette exige que l\'ami ne refuse point. En offrant, celui que l\'on visite a soin de montrer qu\'il n\'a aucune mauvaise intention ; refuser serait avoir l\'air de se d√©fier ; dans le style et les usages du pays, ce serait presque dire √† son h√¥te ¬´ qui sait ? Peut-√™tre veux-tu m\'enpoisonner ¬ª. Le y√©vogan donc √† fait porter √† boire et nous avons bu. Voici comment les choses se sont pass√©es : un serviteur est arriv√©, tenant √† la main un plateau sur lequel √©taient trois verres, une bouteille d\'eau et un flacon de gin. Apr√®s avoir pos√© le plateau, il a vers√© de l\'eau dans un verre ; puis il a pass√© cette eau dans les deux autres verres, de mani√®re √† lui en faire toucher les parois int√©rieures, et il a bu l\'eau. Il nous disait √† sa mani√®re : ¬´ Voyez ! Ni l\'eau, ni les verres ne cachent la mort. ¬ª Servant ensuite de l\'eau √† tous, il nous mettait en demeure de nous prononcer nous m√™mes. Ne pas boire eut √©t√© un signe de d√©fiance dont le y√©vogan aurait eu le droit de se formaliser. ¬ª', NULL, 1),
(617, 115, 91, NULL, 'literal', '', 'p.400 : ¬´ Voici les principes sur lesquels sont bas√©s les relations du Dahomey avec les blancs :\r\n1¬∞ Les blancs n\'entrent au Dahomey que par pure tol√©rance.\r\n2¬∞ Ils n\'en peuvent sortir sans la permission du roi ou des chefs, et apr√®s s\'√™tre fait ouvrir les chemins par eux.\r\n3¬∞ Nul ne s\'√©tablit dans le royaume qu\'avec la permission expresse du roi\r\n4¬∞ On n\'est pas libre de circuler √† l\'int√©rieur √† moins de s\'y √™tre fait autoriser. 5¬∞ Quinconque veut se livrer au n√©goce doit se faire ouvrir les chemins POUR LE COMMERCE ; les autorit√©s se r√©servant toujours le droit de les lui fermer, quand bon leur semblera.\r\n6¬∞ Les n√©gociants ne sont pas libres d\'acheter les produits du pays dont l\'exportation n\'a pas √©t√© approuv√©e. On leur d√©fend de vendre certaines marchandises, l\'√©toffe du roi, par exemple. Il y en a d\'autres qu\'on ne leur permet pas de vendre en d√©tail, le droit de les d√©tailler √©tant un privil√®ge r√©serv√© aux gens de l\'endroit.\r\n7¬∞ Quelques fois la valeur de certains produits exotiues varie, de telle sorte que le n√©gociant est oblig√© de hausser notablement ses prix. Ce changement de prix, si bien motiv√© qu\'il soit, expose √† des palavres et √† de fortes amendes.', NULL, 1),
(618, 115, 91, NULL, 'literal', '', 'P.403 : ¬´ En terminant, qu\'il nous soit permis de d√©plorer l\'influence pernicieuse des blancs au Dahomey. En s\'adonnant √† la traite, ils ont rendu n√©cessaire la chasse √† l\'homme. N\'est-ce pas la traite des n√®gres qui a fait du monarque dahom√©en un roi brigand, et de ses sujets une bande de pillards ? Il est temps de traiter les noirs en hommes. Cessons de les consid√©rer comme une race inf√©rieure et maudite. Ils ont leur dignit√©, leurs lois, leur droit : respectons-les. Le noir a sa place dans la grande famille humaine : nous avons eu le tort de l\'en exclure ; qu\'il n\'en soit plus ainsi d√©sormais. ¬ª', NULL, 1),
(619, 115, 57, NULL, 'literal', '', 'L\'auteur remit en cause les pr√©jug√©s diffus√©s en Europe sur les Africains. Il se place clairement contre la traite. Montre un point de vue diff√©rent √† un moment o√π les pr√©jug√©s n√©gatifs sont largement admis.', NULL, 1),
