(621, 115, 57, NULL, 'literal', '', 'L\'abb√© Bouche d√©crit ici le r√¥le fondamental dans l\'interpr√®te dans les rencontres avec les chefs africains. Ils ne peuvent converser sans lui.', NULL, 1),
(622, 115, 57, NULL, 'literal', '', 'Description du c√©r√©monial li√© √† la boisson. Outre le fait d\'offrir √† boire √† son invit√©, ce c√©r√©monial sert √† prouver que les deux protagonistes peuvent se faire confiance.', NULL, 1),
(623, 115, 57, NULL, 'literal', '', '√Ä la fin de son ouvrage, l\'abb√© bouche relate les r√®gles strictes auxquelles sont soumis les √©trangers au Dahomey. Les blancs sont accueillis sur ce territoire mais n\'y sont pas libres de leurs mouvements.', NULL, 1),
