(633, 116, 91, NULL, 'literal', '', 'P.27 : Wydah-Plage\r\n\"[...] le roi ne permet pas aux Europ√©ens d\'habiter √† la plage, et d√®s que le soleil se coucge, ces derniers sont oblig√©s de rentrer √† Wydah-ville. Dans quel but cette interdiction? Je n\'ai jamais pu avoir une r√©ponse des gens du pays √† cet √©gars; ils se contentent de dire \"Le roi le d√©fend.\" La v√©ritable raison, √† mons avis et nous en avons eu la preuve, r√©side dans une question de s√©curit√© g√©n√©rale. Le roi craint que pendant la nuit les Europ√©ens restant √† la plage n\'entretiennent des relations avec les navires de guerre et les gens des Popos qui sont fran√ßais et ennemis du Dahomey, et ne favorisent ainsi l\'envahissement possible du pays; tandis qu\'oblig√©s de coucher √† la ville, les Europ√©ens sont tr√®s bien surveill√©s et il leur est impossible de sortir du Dahomey sans l\'assentiment des autorit√©s.\"', NULL, 1),
(634, 116, 57, NULL, 'literal', '', 'Chaudoin par cette description des r√®gles de vie au Dahomey r√©v√®le la m√©fiance du roi vis-√†-vis des Europ√©ens pr√©sents sur son territoire.', NULL, 1),
