(639, 117, 8, NULL, 'literal', '', 'publication en s√©rie imprim√©e', NULL, 1),
(640, 117, 3, NULL, 'literal', '', 'Dispositifs d\'accueil', NULL, 1),
(641, 117, 4, NULL, 'literal', '', 'M. le Dr R√©pin, ex-chirurgien de la Marine Imp√©riale. Son r√©cit est tir√© de ses carnets de voyage.', NULL, 1),
(642, 117, 4, NULL, 'literal', '', 'L\'auteur d√©crit dans son ouvrage plusieurs voyages r√©alis√©s √† travers le monde. Pour se rendre au Dahomey, il quitte Brest, passe par Gor√©e puis arrive √† Ouidah.', NULL, 1),
(643, 117, 91, NULL, 'literal', '', 'p. 74 : \"Pr√©venu de notre arriv√©e, Gh√©zo, monarque alors r√©gnant sur le Dahomey, envoya √† Wydah l\'un de ses aides de camp pour nous saluer et nous donner la route, car aucun √©tranger ne peut p√©n√©trer dans l\'int√©rieur sans l\'expresse permission du roi. Cet officier arriva le 12 octobre, et pr√©senta au capitaine Vallon la canne royale, insigne des fonctions dont il √©tait charg√©. C\'est une des coutumes de ce pays, o√π l\'√©criture est inconnue, que l\'envoy√© d\'un roi ou d\'un seigneur soir porteur d\'un signe visible de la confiance de son ma√Ætre. Le plus souvent c\'est une canne plus ou moins √©l√©gante que le messager remet entre les mains de celui vers lequel il est envoy√©, pendant qu\'il s\'acquitte aupr√®s de lui de sa mission. Il la reprend ensuite, car c\'est une sorte de passe port qui lui assure partout o√π il passed le respect ey l\'ob√©issance due au souverain, et il la remet √† son maire en lui rendant compre de l\'√©xecution de ses ordres.\"', NULL, 1),
(644, 117, 57, NULL, 'literal', '', 'L\'auteur d√©crit le rituel de rencontre entre √©trangers et envoy√© du roi. Cette description recoupe celles faites par d\'autres auteurs, notamment l\'Abb√© Bouche.', NULL, 1),
(645, 118, 1, NULL, 'literal', '', 'Le Dahom√© : souvenirs de voyage et de mission', NULL, 1),
(646, 118, 7, NULL, 'literal', '', '1873', NULL, 1),
(647, 118, 2, NULL, 'literal', '', 'Laffitte, J. (Abb√©)', NULL, 1),
(648, 118, 11, NULL, 'uri', NULL, 'Gallica', 'https://gallica.bnf.fr/ark:/12148/bpt6k6209298w/f81.image', 1),
(649, 118, 8, NULL, 'literal', '', 'monographie imprim√©e ', NULL, 1),
(650, 118, 3, NULL, 'literal', '', 'Dispositifs d\'accueil', NULL, 1),
(651, 118, 4, NULL, 'literal', '', 'L\'Abb√© Laffitte part de Lyon pour se rendre √† Liverpool afin de rejoindre un bateau √† Destination du Dahomey.Il arrive √† Lagos pour se rendre ensuite √† Ouidah', NULL, 1),
(652, 118, 91, NULL, 'literal', '', 'P.43: \" Quoique le th√© e√ªt perdu de sa saveur, je le trouvais excellent. Pendant que je le d√©gustais, un jeune noir qui venait d\'entrer s\'approcha de moi, et le salua √† la fran√ßaise:\r\n\"Bonjour Monsieur, moi parler fran√ßais.\r\n- Ah! Tu parles fran√ßais, toi ? lui dis-je.\r\n- Oui, Monsieur, me r√©pondit-il.\r\n- O√π donc l\'as-tu appris ?\r\n- A la factorie fran√ßaise de Whydah; moi pas savoir beaucoup, mais savoir assez pour parler avec Monsieur.\r\n- Sois le bien venu, mon ami, car j\'ai grand besoin de toi.\"\r\nSans lui, en effet, il m\'e√ªt √©t√© presque impossible d\'organiser mon d√©part pour Whydah.\r\n[...]La soir√©e √©tant d√©j√† tr√®s avanc√©e, je jugeai que le moment √©tait venu de traiter la question de mon voyage. Je commencais √† peine √† exposer mon dessein que le cabac√®re m\'arr√™ta en disant : \"Je ne veux pas que tu partes ce soir, on dirait que je t\'ai mis dehors; ce sera un grand honneur pour moi de te garder jusqu\'√† demain.\" Parlait-il sinc√®rement? J\'aime √† le croire. Mais je me gardai bien d\'accepter une invitation si aimabke: une nuit √† passer dans un taudis n\'avait rien d\'attrayant. Je pr√©ferai continuer mon voyage. Je priai le chef de me procurer quatre n√®gres vigoureux et un hamac; l\'interpr√®te fut charg√© de ce soin.\"', NULL, 1),
(653, 118, 57, NULL, 'literal', '', 'Dans cet extrait l\'auteur d√©crit l\'hospitalit√© dont il fait l\'objet, ainsi que les moyens humains mis √† sa disposition pour la poursuite de son voyage.', NULL, 1),
