(660, 119, 4, NULL, 'literal', '', 'Fr√©d√©ric Schelameur, v√©t√©rinaire √† la l√©gion √©trang√®re.', NULL, 1),
(661, 119, 4, NULL, 'literal', '', 'La campagne du Dahomey a lieu entre 1892 et 1894 et oppose les troupes fran√ßaise de la l√©gion √©trang√®re, men√©e par le colonel Dodds, au royaume Fon de B√©hanzin. B√©hanzin se rend le 15 janvier 1894 et est exil√© en Martinique.\r\nFr√©d√©ric Schelameur fait partie des troupes envoy√©es au Dahomey dans ce cadre. A son arriv√©e √† Cotonou, la ville est d√©j√† aux mains des fran√ßais. Il y est donc accueilli par des compatriotes.', NULL, 1),
(662, 119, 91, NULL, 'literal', '', 'P.47: \"Nous voici donc √† Kotonou! ... Les camarades de l\'escadron nous attendent au d√©barcad√®re; on √©change quelques cordiales poign√©es de main, et, comme c\'est l\'heure du d√©jeuner, nous nous dirigeons volontiers vers la popote, qui a √©t√© insatll√©e dans une petite annexe de l\'√©tablissement deu t√©l√©graphe anglais. Les trois employ√©s, nos compatriotes, nous acceuillent avec la m√™me courtoisie, la m√™me affabilit√© qu\'ils ont d√©j√† t√©moign√© aux officiers du premier d√©tachement. Le directeur, M. Bonnard, s\'est mis √ß notre enti√®re disposition avec tout ce qu\'il poss√®de, ses adjoints font chorus.', NULL, 1),
