(1138, 358, 4, NULL, 'literal', '', ' ce sont les sp√©cialistes du contenu, ceux qui peuvent contextualiser le contenu et donner des informations utiles √† son sujet. En clair, cela permet √† chacun d‚Äôentre nous de donner, sous forme imag√©e, narrative, po√©tique, des informations sur le ou les √©l√©ments du corpus que nous proposons.', NULL, 1),
